text = {
	["Default"] = { name = "-", desc = "名前の無いペイントキット" },
	["so_yellow"] = { name = "Bulldozer", desc = "生産ラインでパーツごとに黄色一色でスプレーペイント。\n\nこのボーンクラッシャーが破滅をもたらす" },
	["so_olive"] = { name = "Groundwater", desc = "パーツごとにオリーブドラブ一色でスプレーペイント。" },
	["so_red"] = { name = "Candy Apple", desc = "パーツごとに赤色と黒色の配色でスプレーペイント。\n\n車にもいいけれど、武器のほうがもっといい" },
	["so_purple"] = { name = "Ultraviolet", desc = "パーツごとに黒色と紫色の配色でスプレーペイント。\n\n優雅なデザインと残虐な目的の融合" },
	["so_night"] = { name = "Night", desc = "パーツごとに夜間作戦用カラーでスプレーペイント。\n\n風がささやき…あなたの首をかみ切る" },
	["so_caramel"] = { name = "Caramel", desc = "パーツごとにカラメル色と黒色の配色でスプレーペイント。" },
	["so_grassland"] = { name = "Grassland", desc = "パーツごとに草原の色でスプレーペイント。" },
	["so_moss"] = { name = "Blue Spruce", desc = "パーツごとにモスグリーン色でスプレーペイント。" },
	["so_sand"] = { name = "Sand Dune", desc = "パーツごとに砂丘の色でスプレーペイント。\n\nターナーが死に、新たな優先事項が生まれた。それはアレックス・キンケイドの救出だー指揮官 フェリックス・ライリー" },
	["so_stormfront"] = { name = "Storm", desc = "パーツごとに嵐のような色でスプレーペイント。\n\nモノレールでお待ちしております" },
	["so_tornado"] = { name = "Tornado", desc = "パーツごとに竜巻のような色でスプレーペイント。\n\nそのシンプルさにだまされてはいけない" },
	["so_whiteout"] = { name = "Whiteout", desc = "白一色にスプレーペイント。\n\n純粋そうに見えるが、見かけによらず… かもしれない" },
	["so_jungle"] = { name = "ジャングル", desc = "パーツごとにジャングルの色でスプレーペイント。" },
	["so_space_marine"] = { name = "Colony", desc = "パーツごとにカーキとグレーでスプレーペイント。" },
	["so_pmc"] = { name = "Contractor", desc = "パーツごとにタン、ネイビー、ダークグリーンでスプレーペイント。\n\nロナ・サブリは、ターナーの追跡役に自分を選ばなかったセバスチャンをまだ恨んでいる" },
	["so_tangerine"] = { name = "Demolition", desc = "パーツごとに黒色と蜜柑色でスプレーペイント。\n\nロナは、自分が思っているとおり優秀だ… ただ、その若さゆえ、皆にそれを言うべきでないことがわかっていないー指揮官 フェリックス・ライリー" },
	["so_orange_accents"] = { name = "Nitro", desc = "so_orange_accents" },
	["cu_broken_path_famas"] = { name = "Afterimage", desc = "絡み合うリボンのたなびきのカスタムペイント。" },
	["cu_bullet_rain_m4a1"] = { name = "Bullet Rain", desc = "弾丸の降る雲のグラフィックをカスタムペイント。" },
	["cu_catskulls_p90"] = { name = "Death by Kitty", desc = "重なった猫のドクロマークが水圧転写されている。" },
	["CSGO_Doomkitty"] = { name = "Doomkitty", desc = "CSGO_Doomkitty" },
	["hy_ddpat"] = { name = "Forest DDPAT", desc = "デジタルディストラクティブパターン(DDPAT) が水圧転写されている。\n\nそれが画素だと気づけるほど近づいたときにはもう手遅れだ" },
	["hy_ddpat_urb"] = { name = "Urban DDPAT", desc = "hy_ddpat_urb" },
	["hy_ddpat_jungle"] = { name = "Jungle DDPAT", desc = "hy_ddpat_jungle" },
	["hy_ddpat_orange"] = { name = "Orange DDPAT", desc = "hy_ddpat_orange" },
	["hy_ddpat_pink"] = { name = "Pink DDPAT", desc = "hy_ddpat_pink" },
	["hy_ddpat_desert"] = { name = "Desert DDPAT", desc = "hy_ddpat_desert" },
	["hy_arctic"] = { name = "Arctic Camo", desc = "北極迷彩柄が水圧転写されている。\n\n雪は冷たい、死はもっと冷たい" },
	["hy_arctic_contrast"] = { name = "Polar Camo", desc = "hy_arctic_contrast" },
	["hy_arctic_glacier"] = { name = "Arctic Glacier Camo", desc = "hy_arctic_glacier" },
	["hy_dive"] = { name = "Dive Camo", desc = "青迷彩の柄が水圧転写されている。\n\n我々の世界は陰謀に満ちている… だが、時に迷彩柄は見つけられるためにあるのだー武器商人 ブース" },
	["hy_ocean"] = { name = "Bright Water", desc = "hy_ocean" },
	["hy_forest"] = { name = "Wood Camo", desc = "森迷彩柄が水圧転写されている。\n\n森は危険な場所だ… 1人で踏み入ってはならない" },
	["hy_forest_winter"] = { name = "Winter Forest", desc = "hy_forest_winter" },
