	["hy_webs"] = { name = "Crimson Web", desc = "赤色の下地にクモの巣模様が水圧転写され、半光沢のトップコートで仕上げられている。\n\n歩く場所にご注意。どこにクモの巣が広がっているかわからない" },
	["hy_splatter"] = { name = "Blue Streak", desc = "アクアブルーの下地に半透明のスプラッター模様が水圧転写されている。" },
