	["sp_tape"] = { name = "Bone Mask", desc = "ステンシルとして絡まったマスキングテープを用いてスプレーペイント。\n\n真の力は、巧みに応用する場合に発揮される" },
	["sp_tape_orange"] = { name = "Orange Peel", desc = "sp_tape_orange" },
	["sp_tape_urban"] = { name = "Urban Masked", desc = "sp_tape_urban" },
	["sp_mesh"] = { name = "Driftwood Mesh", desc = "ステンシルとしてメッシュフェンスと段ボールの切り抜きを用いてスプレーペイント。\n\n捕食者は、捕食者である。どんな環境にあろうとも" },
	["sp_mesh_tan"] = { name = "Safari Mesh", desc = "sp_mesh_tan" },
	["sp_mesh_arctic_contrast"] = { name = "Polar Mesh", desc = "sp_mesh_arctic_contrast" },
	["sp_mesh_fire"] = { name = "Condemned", desc = "sp_mesh_fire" },
	["sp_mesh_glacier"] = { name = "Glacier Mesh", desc = "sp_mesh_glacier" },
	["sp_mesh_sand"] = { name = "Sand Mesh", desc = "sp_mesh_sand" },
	["sp_snake"] = { name = "Snake Camo", desc = "フリーハンドで輪郭を取った布片とヘビの皮のステンシルを用いてスプレーペイント。" },
	["an_silver"] = { name = "Silver", desc = "クロムの下地でペイントされ、透過性のあるシルバーのアルマイト加工が施されている。\n\nシンプルさの中に美しさがあるーフェニクス参謀 フランツ・クリーゲルド" },
	["an_red"] = { name = "Hot Rod", desc = "クロムの下地でペイントされ、透過性のある赤色のアルマイト加工が施されている。\n\nオートマティック。システマティック。ハイドロマティック。" },
	["an_gunmetal"] = { name = "Anodized Gunmetal", desc = "an_gunmetal" },
	["an_navy"] = { name = "Anodized Navy", desc = "クロムの下地でペイントされ、透過性のある濃紺色のアルマイト加工が施されている。" },
	["am_urban"] = { name = "Metallic DDPAT", desc = "金属の下地に都会的なデジタルディストラクティブパターン (DDPAT) の水圧転写がされている。" },
	["am_tiger"] = { name = "Gold Tiger", desc = "金メッキが施され、虎縞が手でエッチングされている。" },
	["am_dragon_glock"] = { name = "Dragon Tattoo", desc = "金属の下地にドラゴンのステッカーがペイントされている。\n\nおとぎ話の中の騎士はいつでもドラゴンを倒す…だが、ここは現実の世界なのだー革命家 ヴァレリア・ジェンナー" },
	["am_caustics"] = { name = "Caustics", desc = "チャコールメタリックの下地に赤色と白色が水圧転写されている。" },
	["am_lightning_awp"] = { name = "Lightning Strike", desc = "金属の下地にアルマイト加工を用いた落雷のモチーフがペイントされている。\n\n同じ場所を二度攻撃する必要がない時もある" },
	["am_ossify"] = { name = "Ossified", desc = "金属の下地に透過性のあるライムグリーン色の抽象的な水圧転写がされている。" },
	["aa_flames"] = { name = "Blaze", desc = "クロムの下地に透過性のある塗料のエアブラシでペイントされている。" },
	["aa_splash_p250"] = { name = "Splash", desc = "クロムの下地にステンシルを使い透過性のある塗料のエアブラシでペイントされている。" },
	["aa_fade"] = { name = "Fade", desc = "クロムの下地に透過性のある塗料のエアブラシで相互に色が薄くなるようにペイントされている。\n\nこれはただの武器ではない。芸術品だー武器商人見習い イモジェン" },
	["aa_fade_metallic"] = { name = "Amber Fade", desc = "aa_fade_metallic" },
	["aa_fade_grassland"] = { name = "Acid Fade", desc = "aa_fade_grassland" },
	["aq_copper"] = { name = "Copper", desc = "銅メッキが施されている。" },
	["aq_blued"] = { name = "Blue Steel", desc = "コールドブルーでペイントされている。\n\nこれは武器デザインのマルベックだー武器商人 ブース" },
	["aq_forced"] = { name = "Stained", desc = "表面にレモンとマスタードを塗って装飾錆を発生させたもの。\n\nもしこの状態で汚く見えるのなら、ブラックライトで見るまで待つといい" },
	["aq_oiled"] = { name = "Case Hardened", desc = "高温の木炭を使った彩色による表面硬化処理が施されている。\n\n少しぐらい派手でも、誰も困りはしない" },
	["sp_spitfire_famas"] = { name = "Spitfire", desc = "sp_spitfire_famas" },
	["am_zebra"] = { name = "Slaughter", desc = "異なる反射率を持つアルミニウムとクロムを使って縞模様がペイントされ、トマトレッドでキャンディーコーティングが施されている。\n\nヴァレリアがハビエルに金を払ったのは質問するためではない… 答えを聞き出すためだ" },
	["am_zebra_dark"] = { name = "Dark Water", desc = "クロムの下地に異なる反射率を持つチャコールメタリックのペイントを用いてアクアストライプの模様がペイントされている。\n\n水は生命を与える、だが生命を奪いもする" },
	["aa_vertigo"] = { name = "Hypnotic", desc = "真珠色の下地でペイントされた後に、図式的な模様のステンシルを用いて黒色でスプレーペイント。\n\n眠気じゃない、血を失って気絶しかかっているだけだ" },
	["cu_spring_nova"] = { name = "Bloomstick", desc = "桜のモチーフがエアブラシでハンドペイントされ、高光沢のトップコートが施されている。" },
	["sp_hazard"] = { name = "Hazard", desc = "sp_hazard" },
	["aq_rust"] = { name = "Rusty", desc = "この武器の外面は錆びているが、何の問題もなく使用できる。" },
	["am_slither_p90"] = { name = "Cold Blooded", desc = "クロムの下地でペイントされ、透過性のある赤色のアルマイト加工が施されている。さらに、滑るように進むヘビのモチーフがレーザーエッチングされている。" },
	["am_carbon_fiber"] = { name = "Carbon Fiber", desc = "黒鉛被覆の上に炭素繊維を意識した模様を水圧転写することによって塗装しています。\n\n私がチームを引っ張ったのは確かだけど、みんなも頑張ったんだよ。- 期待の新星 ロナ・サブリ" },
	["am_scorpion_p2000"] = { name = "Scorpion", desc = "グリップには赤いサソリのステッカーが貼られ、波紋のフェード模様のアルマイト加工が施されている。" },
	["hy_feathers_aug"] = { name = "Wings", desc = "ワシの羽根のドライ転写ステッカーで装飾されている。\n\nワシに威厳に感心していられるのは、自分の目をえぐられるまでだ" },
	["sp_palm"] = { name = "Palm", desc = "ステンシルに、段ボールの切り抜きと目の細かいメッシュ、そしてヤシの葉を用いてスプレーペイント。" },
	["sp_palm_shadow"] = { name = "Tropical Storm", desc = "sp_palm_shadow" },
	["cu_walnut_nova"] = { name = "Walnut", desc = "模様のあるクルミの木のストック付き。" },
	["aq_brass"] = { name = "Brass", desc = "一部が真ちゅうに取り替えられている。\n\nフールズ・ゴールド" },
	["hy_blam"] = { name = "KABOOM!", desc = "オレンジ色の下地にコミック風の擬音が水圧転写されている。" },
	["hy_blam_simple"] = { name = "BOOM", desc = "hy_blam_simple" },
	["sp_dapple"] = { name = "Scorched", desc = "木漏れ日の模様がスプレーペイントされている。\n\nフェニックスは破壊の象徴ではない... 再生の象徴なのだ。ー革命家 ヴァレリア・ジェンナー" },
	["sp_splash_p250"] = { name = "Splash", desc = "スプラッシュの形のステンシルでスプレーペイント。" },
	["hy_hunter_modern"] = { name = "Modern Hunter", desc = "鮮明な狩猟用迷彩柄が水圧転写されている。" },
