	["hy_hunter_blaze_orange"] = { name = "Blaze Orange", desc = "hy_hunter_blaze_orange" },
	["sp_nukestripe_brown"] = { name = "Irradiated Alert", desc = "sp_nukestripe_brown" },
	["sp_nukestripe_maroon"] = { name = "Fallout Warning", desc = "sp_nukestripe_maroon" },
	["sp_nukestripe_orange"] = { name = "Radiation Hazard", desc = "sp_nukestripe_orange" },
	["sp_nukestripe_green"] = { name = "Nuclear Threat", desc = "sp_nukestripe_green" },
	["sp_zebracam"] = { name = "Predator", desc = "縞模様がスプレーペイントされている。" },
	["sp_zebracam_bw"] = { name = "Faded Zebra", desc = "sp_zebracam_bw" },
	["sp_zebracam_blue"] = { name = "Azure Zebra", desc = "sp_zebracam_blue" },
	["CSGO_Camo"] = { name = "GO 迷彩", desc = "Global Offensive の迷彩柄が水圧転写されている。" },
	["CSGO_Icosahedron"] = { name = "Memento", desc = "幾何学模様が水圧転写されている。" },
	["cu_fireserpent_ak47_bravo"] = { name = "Fire Serpent", desc = "火の蛇のモチーフがペイントされた Ruins 記念モデル。\n\n街で生き残りたければ、火の吹き方を学べ" },
	["cu_favela"] = { name = "Corticera", desc = "コルティセラの木のモチーフがペイントされている。" },
	["cu_dragon_p90_bravo"] = { name = "Emerald Dragon", desc = "ドラゴンのモチーフがペイントされた Chinatown 記念モデル。\n\n伝説は危険なものにもなり得る" },
	["hy_siege_bravo"] = { name = "Overgrowth", desc = "迷彩柄が水圧転写された Siege 記念モデル。\n\n私の目を見て答えろ。これのどこが標準仕様なんだ？ー指揮官 フェリックス・ライリー" },
	["am_scales_bravo"] = { name = "Golden Koi", desc = "うろこ模様の金属箔で覆われた Chinatown 記念モデル。\n\nいろんな意味で派手な銃" },
	["aq_etched_mac10_bravo"] = { name = "Graven", desc = "彫刻の入った真ちゅうのパーツがある Gwalior 記念モデル。\n\n同時にふたつの戒めを破るもの" },
	["cu_season_elites_bravo"] = { name = "Black Limba", desc = "黒錆加工が施され、グリップに黒いリンバの木が使われたAgency 記念モデル。\n\nクラシックな構造とモダンな美学の出会い" },
	["hy_seaside_bravo"] = { name = "Tempest", desc = "波と雲のモチーフが水圧転写されたSeaside 記念モデル。\n\n嵐が来る" },
	["hy_crumple_dark_bravo"] = { name = "Facets", desc = "hy_crumple_dark_bravo" },
	["hy_crumple_bravo"] = { name = "Shattered", desc = "多角形模様が水圧転写されたAgency 記念モデル。\n\n私のチームはプロだ、この仕事を上手く片付けるだろう…ープロの犯罪者 エリオット・キングスマン" },
	["hy_bluepolygon_bravo"] = { name = "Demeter", desc = "hy_bluepolygon_bravo" },
	["hy_ali_tile_bravo"] = { name = "Mosaico", desc = "hy_ali_tile_bravo" },
	["an_emerald_bravo"] = { name = "Emerald", desc = "クロムの下地に透過性のあるエメラルド色のアルマイト加工が施された Chinatown 記念モデル。\n\n偉大なるセバスチャン・エンケがここまで落ちぶれたのか？ まるで口うるさい女教師だ。何があったんだ...？ ―「教師と反逆児」その2" },
	["hy_mayan_dreams_bravo"] = { name = "Mayan Dreams", desc = "マヤの雲のモチーフが水圧転写されたRuins 記念モデル。\n\n時には犠牲が必要とされることもある" },
