	["so_orca"] = { name = "Tuxedo", desc = "パーツごとに黒色と白色の配色でスプレーペイント。\n\nセミフォーマルウェアで戦うときに" },
	["am_army_shine"] = { name = "Army Sheen", desc = "迷彩柄がスタンプされた金属箔で覆われている。\n\n訓練を思い出して" },
	["am_oval_hex"] = { name = "Caged Steel", desc = "ステンシルを用いて、金属フレークの塗料で六角形の模様がペイントされた後に、楕円形の切り出しが水圧転写されている。\n\n「待って」と言え！" },
	["cu_pinstripe_ak47"] = { name = "Emerald Pinstripe", desc = "ストックにはボグオークを使用し、白色と緑色のピンストライプをペイント。\n\nイモジェンを疑うことは私を疑うことだ。まあ落ち着いて、スコッチでも飲みながら仕事の話をしよう。ー「父と不死鳥」その2" },
	["sp_nightstripe"] = { name = "Night Stripe", desc = "夜間作戦用カラーのテープマスク柄にスプレーペイント。\n\nスプレーして… 祈り… ペイントして… 突き刺す。" },
	["cu_m4_asimov"] = { name = "アシモフ", desc = "SFチックなデザインのカスタムペイント。\n\n凡人は未来を予想し、賢人は未来を創造する" },
	["cu_sawedoff_octopump"] = { name = "クラーケン", desc = "タコが描かれた手書き風ペイント。\n\nヤツが、解き放たれた" },
	["cu_m4a1-s_elegant"] = { name = "Guardian", desc = "コバルトブルーを基調とし、弾倉にCTのロゴが描かれたペイント。\n\nあんたを気に入らなくても、守ることはできる。―救出スペシャリスト、カルメン・コシネロ" },
	["cu_p250_refined"] = { name = "Mehndi", desc = "ペイズリー柄が水圧転写されている。\n\nナマステ" },
	["cu_awp_cobra"] = { name = "Redline", desc = "カーボンファイバー水圧転写ならびに赤いピンストライプのドライトランスファーデカールが施されている。\n\n恐れることなく限界に挑め" },
	["cu_famas_pulse"] = { name = "Pulse", desc = "大胆な赤紫色の柄が水圧転写されている。\n\n攻めの武器は攻めたカラーで" },
	["hy_marina_sunrise"] = { name = "Marina", desc = "黄色と青のコントラストが鮮やかな水圧転写ペイント。\n\nある人は君を英雄と呼び、別の人は悪党と呼ぶ" },
	["am_thorny_rose_mp9"] = { name = "Rose Iron", desc = "薔薇と棘のモチーフを様々な色のメタリックペイントで表現。\n\n指を刺さないように" },
	["cu_skull_nova"] = { name = "Rising Skull", desc = "マットペイントと油性ペイントマーカーで髑髏を描いたカスタム仕様。\n\nイザキさん、不満があるわけじゃないけど... ショットガン何丁持てば気が済むの？ ―「イモジェンと鬼」その1" },
	["cu_sandstorm"] = { name = "Sandstorm", desc = "パープルとベージュのデザインが水圧転写されている。\n\nタープ1枚では身を守れない" },
	["hy_kami"] = { name = "Kami", desc = "日本のマンガが水圧転写で描かれている。\n\n幽霊は墓から出たがるものだ" },
	["aq_obsidian"] = { name = "Magma", desc = "一部のパーツはマグマの模様が描かれた銅板製で、さらに塩化ナトリウムと高温による緑青処理がなされている。\n\n赤熱するほどの連射能力" },
	["am_turqoise_halftone"] = { name = "Cobalt Halftone", desc = "ターコイズのメタリックペイント下地の上に、オーバーサーズのハーフトーン柄が水圧転写されている。\n\nフェリックス、ヴァレリアが戦争を始めたがっているのは明らかだ。おたくには、その備えができているのか？ ―武器商人 ブース" },
	["cu_aug_chameleonaire"] = { name = "カメレオン", desc = "カメレオンを描いたカスタムペイント。\n\n巧妙に事を運べば状況は一変する" },
	["cu_ump_corporal"] = { name = "伍長", desc = "ミリタリーモチーフのカスタムペイント。\n\n尊敬は手に入るものではなく、手に入れるものだ" },
	["cu_p90_trigon"] = { name = "Trigon", desc = "オレンジ、グレー、ブラックでコントラストを際立たせたカスタムペイント。\n\n台風のように暴れまくれ" },
	["cu_mac10_redhot"] = { name = "Heat", desc = "鍛冶場の炉から取り出された鋼をイメージしたカスタムペイント。\n\nどう鍛えていくかは自分次第" },
	["sp_negev_turq_terrain"] = { name = "地形", desc = "地形モチーフを取り入れた水圧転写ペイント。\n\n公平であるべき立場のわりに、娘さんの交友関係には偏りがあるな。―「父親と不死鳥」その1" },
	["cu_nova_antique"] = { name = "Antique", desc = "水圧転写とドライトランスファーデカールを組み合わせて、金の象嵌を施した木製ストックを模している。\n\n年月は知恵を深め、ストッピングパワーを高める" },
	["an_famas_sgt"] = { name = "軍曹", desc = "マスキング液を使ってツヤの濃淡を生み、ミリタリーモチーフを表現。仕上げはサテン加工。\n\n率先垂範を心がけよ" },
	["cu_mag7_heaven"] = { name = "Heaven Guard", desc = "繊細な柄の水圧転写とドライトランスファーデカールの翼が特徴。\n\n天使の翼が見えても、救われるとは限らない" },
