	["cu_usp_sandpapered"] = { name = "Road Rash", desc = "飛び出す銃弾の絵をペイントし、サンドペーパーでダメージ加工を施している。" },
	["hy_ssg08_marker"] = { name = "Detour", desc = "白ベースのコーティングの上に油性ペンで装飾を入れている。" },
	["am_royal"] = { name = "Chalice", desc = "クロムの下地でペイントされ、透過性のあるロイヤルブルーのアルマイト加工が施されている。\n\n正しい選択だ" },
	["am_metals"] = { name = "Knight", desc = "中世の鎧をモチーフにしており、真鍮の象嵌が施されている。\n\nコシネロとイザキが見当たらない？ どういうことだ？ ―指揮官 フェリックス・ライリー" },
	["am_chainmail"] = { name = "Chainmail", desc = "シルバーの下地の上に半透明の水圧転写で鎖帷子の模様が描かれている。\n\nフェニックスのメンバーは数多くいるが、ヴァレリアのボディガードを務めるナオミほど彼女に忠実な者はいない" },
	["aq_handcannon"] = { name = "Hand Cannon", desc = "ビンテージの真鍮製大砲をイメージし、真鍮パーツに緑青加工を施している。\n\nこれより先、数々の試練で困難に直面するものと心せよ" },
	["am_metal_inlay"] = { name = "Dark Age", desc = "メタリック塗料を使って中世風モチーフが象嵌されているかのように表現。\n\n彼女の愛人を殺すことはできる... そうすればお前がヴァレリアから逃げる時間を少しは稼げるかもしれない。―「父の愛」その2" },
	["hy_vines"] = { name = "Briar", desc = "茨と花が描かれた水圧転写ペイント。\n\n愛する人のくちづけでさえ、その棘からは救ってくれない" },
	["so_indigo"] = { name = "Royal Blue", desc = "インディゴ、真紅、グレーのソリッドカラーペイント。\n\n少しは笑ったら、フェリックス？ いつもムスッとしてたら女運だって逃げていくよ。―武器商人見習い イモジェン" },
	["so_indigo_and_grey"] = { name = "Indigo", desc = "インディゴ、ブルー、グレーのソリッドカラーペイント。\n\nアレックス・キンケイド、訊ねたいことが沢山あるようだから... 私が答えよう。―「不死鳥と語り手」その1" },
	["cu_well_traveled_ak47"] = { name = "Jet Set", desc = "ストック部分を茶色のレザーで覆っている。この銃は多くの都市を旅してきた。\n\n注意深く見ていれば、点と点をつないで彼女が何をしたのか分かるはずだ。悠長に解決策を探している場合ではない... ―「父の愛」その2" },
	["cu_green_leather"] = { name = "First Class", desc = "ストック部分を緑色のレザーで覆っている。\n\nミモザはお出ししておりません" },
	["cu_brown_leather_p90"] = { name = "Leather", desc = "ストック部分を茶色のレザーで覆っている。\n\nTSA安全基準は遵守しているのでご心配なく" },
	["cu_luggage_mac10"] = { name = "Commuter", desc = "格子柄のペイントの上にクロコダイルのフェイクレザーをあしらっている。\n\nエサに食いついたな。いくぞ。―傭兵 エリオット・キングスマン" },
	["cu_medieval_dragon_awp"] = { name = "Dragon Lore", desc = "ノットワーク細工のドラゴンを描いたカスタムペイント。\n\n鍵が200個あろうとも、秘密は解明できない" },
	["cu_luggage_p2000"] = { name = "Coach Class", desc = "格子柄の水圧転写ペイント。グリップの一部には茶色のレザーを使っている。\n\n豪華とは言えないが、目的地までは運んでくれる" },
	["aq_pilot_deagle"] = { name = "Pilot", desc = "真鍮製のパイロット徽章が象嵌されている。\n\n衝撃防止姿勢を" },
	["cu_leather_xm1014"] = { name = "Red Leather", desc = "ストックとグリップを赤いレザーで覆っている。\n\n荷物をまとめろ。クソ野郎を殺しに行くぞ。―「鬼とヴァルキリー」その2" },
	["cu_luggage_sg553"] = { name = "Traveler", desc = "ビンテージものの旅行鞄をイメージしたストライプが入っており、ところどころに茶色のレザーを使用。\n\n誰もが何かしらの物語を抱えており、ハビエルはそれを無理やり聞き出してから殺す" },
	["cu_luggage_usp-s"] = { name = "Business Class", desc = "ビンテージものの旅行鞄とした色合いと柄のカスタムペイント。ところどころに茶色のレザーを使用。\n\n足もとに余裕があるだけでは物足りない... 静かにくつろげる空間を求める人のために" },
	["hy_plaid1"] = { name = "Olive Plaid", desc = "ベージュとオリーブグリーンの格子柄を水圧転写したもの。\n\nいいね。目元がいい感じに映る。―期待の新星 ロナ・サブリ" },
	["chy_plaid2"] = { name = "Green Plaid", desc = "chy_plaid2" },
	["cu_m4a1-s_silence"] = { name = "Master Piece", desc = "『Wild Style』のグラフィティが入ったカスタムペイント。" },
