	["am_nuclear_skulls1_xm1014"] = { name = "Bone Machine", desc = "クロム下地の上に、半透明の水圧転写で放射能マーク入り髑髏が描かれている。" },
	["am_nuclear_skulls2_famas"] = { name = "Styx", desc = "クロム下地の上に、半透明の水圧転写で放射能マーク入り髑髏が描かれている。" },
	["am_nuclear_skulls3_mac10"] = { name = "Nuclear Garden", desc = "クロム下地の上に、半透明の水圧転写で放射能マーク入り髑髏が描かれている。" },
	["hy_nuclear_skulls4_p250"] = { name = "Contamination", desc = "水圧転写で放射能マーク入り髑髏が描かれている。" },
	["hy_nuclear_skulls5_tec9"] = { name = "Toxic", desc = "派手な色合いの水圧転写で放射能マーク入り髑髏が描かれている。" },
	["so_grey_nuclear_green_bizon"] = { name = "Chemical Green", desc = "グレーと派手なグリーンのソリッドカラーペイント。" },
	["so_grey_nuclear_orange_five_seven"] = { name = "Hot Shot", desc = "ライトグレーとホットグリーンのソリッドカラーペイント。" },
	["cu_cerbrus_galil"] = { name = "Cerberus", desc = "三つの頭を持つ冥界の番犬、ケルベロスを描いたカスタムペイント。" },
	["cu_tribute_ak47"] = { name = "Wasteland Rebel", desc = "ダメージ加工されたブロックプリントに加えてグラフィティが入っている。\n\n彼らはいつの日か、私たちに戦う理由を問うだろう。そしてそのとき、ようやく理解するのだ。―ヴァレリア・ジェンナーの側近 ナオミ" },
	["aq_glock_coiled"] = { name = "Grinder", desc = "スチール製のスライドにステンシルと油性塗料で手描きのペイントが施されている。\n\nダイヤを生む方法はただひとつ、圧力を加えることだ" },
	["am_g3sg1_murky"] = { name = "Murky", desc = "アルマイト加工の後に水圧転写でヒョウ柄をペイント。\n\nどこにいようとも、世の中にはさらなる暗がりが存在する" },
	["aq_m4a1s_basilisk"] = { name = "Basilisk", desc = "バシリスクがエッチングされている。\n\nジロジロ見るのは失礼に当たるが、戦争中に礼儀など気にしていられない" },
	["cu_m4a4_griffin"] = { name = "Griffin", desc = "グリフィンの絵が手描きされている。\n\nフェリックスは世界中からオペレーターを選抜してチームを組織した... 彼らの性格について懸念する声もあるが、その成果に文句を言う者はいない" },
	["sp_mag7_firebitten"] = { name = "Firestarter", desc = "末端部が燃えているように見せるため、スプレーで何層もペイントしてからダメージ加工を施している。\n\n小さな火花がきっかけとなる" },
	["cu_mp9_chevron"] = { name = "Dart", desc = "水圧転写によって山形紋のかたちにペイントしている。\n\n何度も何度も投げていれば、いずれはど真ん中に命中する" },
	["aq_p250_cartel"] = { name = "Cartel", desc = "ガイコツと花と蛇が彫刻されている。\n\n指に少し力を入れるだけで、毎朝「死者の日」を迎えられる" },
	["cu_p2000_fire_elemental"] = { name = "Fire Elemental", desc = "炎属性のクリーチャーが描かれたカスタムペイント。\n\nたまには火遊びも悪くない" },
	["aq_sawedoff_blackgold"] = { name = "Highwayman", desc = "ゴロツキアザミのモチーフが黒と金でラッカー塗装されている。\n\n小指を立てなくてもトリガーは引けるが、ちょっとしたおしゃれポイントにはなる" },
	["cu_scar20_intervention"] = { name = "Cardiac", desc = "近代的なオレンジとブルーのデザインがプレプリントされたビニール製の熱収縮フィルムを使用。\n\nピッ、ピッ、ピッ、ピィィィィィィ..." },
	["sp_ump45_d-visions"] = { name = "Delusion", desc = "オウムガイめいたものをスクリーンプリント。\n\nカルコサが呼んでいる..." },
	["cu_xm1014_caritas"] = { name = "Tranquility", desc = "長い髪の女性が手描きされている。\n\n必要だからじゃない、欲しいから来たんだ。―「イモジェンと鬼」その2" },
	["am_awp_glory"] = { name = "Man-o'-war", desc = "ブルーのメタリック塗装を下地にし、メタリックゴールドのアクセントが手描きされている。\n\n振り向かせてから始末しろ" },
	["cu_elites_urbanstorm"] = { name = "Urban Shock", desc = "ブルーのアクセントが入ったアーバン迷彩のカスタムペイント。\n\n稲光あるところ雷鳴あり" },
	["aq_deagle_naga"] = { name = "Naga", desc = "神話をモチーフにした彫刻が施されている。\n\nインド神話の蛇神は戦場でも脅威となる" },
	["cu_galil_abrasion"] = { name = "Chatterbox", desc = "手描きペイントした後にダメージ加工を施している。ダストカバーに描かれた髑髏はボルトが動くと喋っているように見える。\n\n子供が笑えば世界も笑う、こいつが笑えば泣き叫ぶ" },
	["cu_glock_deathtoll"] = { name = "Catacombs", desc = "シルバーのメタリック塗料の下地に頭蓋骨が水圧転写されています。\n\n模倣は最も誠実なほめ言葉" },
	["cu_m4a4_ancestral"] = { name = "龍王 (Dragon King)", desc = "赤と青でドラゴンを描いたカスタムペイント。\n\n美猴王にふさわしい武器だ。―武器商人 ブース" },
	["cu_m249_sektor"] = { name = "System Lock", desc = "SFチックなデザインのカスタムペイント。\n\n援護射撃がこれほど美しく見えたことがあっただろうか" },
	["am_mac10_malachite"] = { name = "Malachite", desc = "メタリックエフェクト塗料を使用し、ラバーコームで波打つようなテクスチャを表現。\n\n明るい色にはどす黒い意図が隠されている" },
	["cu_mp9_deadly_poison"] = { name = "Deadly Poison", desc = "クモをダイナミックにデザイン化したカスタムペイント。\n\n最初のひと噛みでは死なないが、続く29回でやがて死ぬ" },
	["cu_p250_mandala"] = { name = "Muertos", desc = "円形のモチーフを描いたカスタムペイント。\n\n伝統と血がしみ込んでいる" },
	["cu_sawedoff_deva"] = { name = "Serenity", desc = "翼のある女性が手描きされている。\n\n平穏は贅沢品だ。ごくわずかな人間しか手に入れられない。―革命家 ヴァレリア・ジェンナー" },
	["aq_scar20_leak"] = { name = "Grotto", desc = "ブルーのメタリックエフェクト塗料をスポンジと絵筆でペイントしている。\n\nシーズン社の創業者は高名なオペレーター、コタロウ・イザキによって救出された後、このモデルを委嘱した" },
	["aq_xm1014_sigla"] = { name = "Quicksilver", desc = "メタリックシルバー塗料の上に半透明の水圧転写ペイントで地形図が描かれている。\n\n不安定要素が問題の解決につながることもある。―侵入スペシャリスト コタロウ・イザキ" },
	["an_tiger_orange"] = { name = "Tiger Tooth", desc = "オレンジ色のアルマイト加工を施し、虎縞を手作業でエッチングしている。\n\n虎のように希少で、虎のように危険" },
	["am_marble_fade"] = { name = "Marble Fade", desc = "黒とシルバーのメタリック塗料でマーブリングし、3色のキャンディコーティングを施している。\n\nカラフルなブレードだが、やがては真紅に染まる" },
	["am_marbleized"] = { name = "Doppler", desc = "黒とシルバーのメタリック塗料をマーブリングし、さらにキャンディコーティングを施している。\n\n色に見とれていると命取りになる" },
	["cu_ak47_mastery"] = { name = "Elite Build", desc = "It has been custom painted using a combination of hydrographics and careful stenciling and detailed with heat-transfer decals.\n\nTread softly Naomi...people in your line of work aren't known for their longevity - The Shield and The Serpent Part 2" },
	["aq_mp7_ultramodern"] = { name = "Armor Core", desc = "黒の油性塗料でペイントし、ステンレススチールのパーツと象嵌を用いている。\n\n火力とスタイルを両立させたいオペレーターにはもってこいの品だ。―武器商人 ブース" },
	["aq_awp_twine"] = { name = "Worm God", desc = "耐久性の高いエナメル塗料で髑髏と植物の根を描いている。\n\n張られては困る根もある" },
	["am_bronze_sparkle"] = { name = "Bronze Deco", desc = "自動車用のメタリック塗料をつかってアールデコ調の柄をペイント。\n\n皆が金と銀を求めるなか..." },
	["aq_p250_contour"] = { name = "Valence", desc = "武器のフォルムを際立たせる、ブルーとグレーの近代的なカスタムペイント。\n\nスキルは疑いようがない。問題なのは態度だ。―「教師と反逆児」その1" },
	["cu_fiveseven_banana"] = { name = "Monkey Business", desc = "これはバナナです。\n\nたまには食べ物で遊んだっていい" },
	["cu_galil_eco"] = { name = "Eco", desc = "白とグリーンでペイントされ、熱転写デカールのディテールを入れている。\n\nエリートクルーは支払いさえよければどんな活動も引き受ける" },
	["aq_famas_jinn"] = { name = "Djinn", desc = "ゴールドとニッケルが象嵌され、ジンの像が彫刻されている。\n\n願い事は慎重に" },
	["cu_m4a1_hyper_beast"] = { name = "Hyper Beast", desc = "It has been custom painted with a beastly creature in psychadelic colours.\n\nYou really want to impress me Booth? Make this black light sensitive - Rona Sabri, Rising Star" },
	["cu_mag7_redhot"] = { name = "PaintKit_cu_mac10_redhot_tag", desc = "PaintKit_cu_mac10_redhot" },
	["am_negev_glory"] = { name = "PaintKit_am_awp_glory_Tag", desc = "PaintKit_am_awp_glory" },
	["cu_mac10_neonrider"] = { name = "Neon Rider", desc = "イカしたライダーを描いたカスタムペイント。\n\nカラフル文房具と銃の融合" },
	["cu_sawedoff_origami"] = { name = "Origami", desc = "折り紙をイメージしたカスタムペイント。\n\n美しいものは時間をかけて生み出され、一瞬で破壊される" },
	["cu_cz75_precision"] = { name = "Pole Position", desc = "赤とグレーでモーターレースを表現したカスタムペイント。\n\nチャンスは一度きりだ、しくじるなよ。―指揮官 フェリックス・ライリー" },
	["am_ump_racer"] = { name = "Grand Prix", desc = "往年のモーターレースをイメージしたカスタムペイント。\n\nヘルメットを忘れずに" },
	["am_aqua_flecks"] = { name = "Twilight Galaxy", desc = "am_aqua_flecks" },
	["cu_chronos_g3sg1"] = { name = "Chronos", desc = "時計機構をサイケデリックな色調の水圧転写で表現し、アクセントに熱転写デカールを使用。\n\n時が経てば、あらゆることが可能になる" },
	["hy_hades"] = { name = "Hades", desc = "古代ギリシャの兜を水圧転写している。\n\n彼女がインタビューを望むのなら、こんな手段を使わなくてもよかったのに。―「盾と語り手」その2" },
	["hy_icarus"] = { name = "Icarus Fell", desc = "太陽の周囲に羽根と溶けた蝋を描いた水圧転写ペイント。\n\nターナーの裏切りは私の責任だ... 私が正さねばならない。―狙撃手 セバスチャン・エンケ" },
	["cu_labyrinth"] = { name = "Minotaur's Labyrinth", desc = "迷宮の等角投影図が水圧転写されている。\n\n我から逃れる術はなし" },
	["sp_labyrinth1"] = { name = "Asterion", desc = "迷宮の等角投影図がステンシルを用いてスプレーペイントされている。\n\n王だってただの人間だ。人間を崇拝するなんて間違っている。―革命家 ヴァレリア・ジェンナー" },
	["sp_labyrinth2"] = { name = "Pathfinder", desc = "迷宮の等角投影図がステンシルを用いてスプレーペイントされている。\n\n個人的には第4版がいいと思うんだが、お客がそう言うなら仕方ない。―武器商人 ブース" },
	["sp_labyrinth3"] = { name = "ダイダロス", desc = "迷宮の等角投影図がステンシルを用いてスプレーペイントされている。\n\nイモジェン... お前のしたことがバレたら、すべてを失うことになるかもしれないぞ。―「家庭の事情」その1" },
	["cu_medusa_awp"] = { name = "Medusa", desc = "ゴルゴンを描いたカスタムペイント。\n\n私の姿が見えたら、死んだも同然だ" },
	["gs_mother_of_pearl_elite"] = { name = "Duelist", desc = "グリップに真珠母貝を使い、黒錆加工が施されている。\n\nおまけのガムは付いていない" },
	["aa_pandora"] = { name = "Pandora's Box", desc = "カートゥーン調のキャラクターがエアブラシで描かれている。\n\n 世界は炎に包まれているが、少なくとも我々には希望がある" },
	["cu_poseidon"] = { name = "ポセイドン", desc = "ポセイドンとピスケスの争いを描いたカスタムペイント。\n\n三人で秘密を守りたいなら、二人に死んでもらえ" },
	["hy_zodiac1"] = { name = "Moon in Libra", desc = "黄道十二宮のモチーフが水圧転写されている。\n\n今日のあなたは恋愛運バツグン、ライバルを殺すのも今日がよいでしょう" },
	["hy_zodiac2"] = { name = "Sun in Leo", desc = "黄道十二宮のモチーフが水圧転写されている。\n\n今月はあなたの敵にとって厳しい期間となるでしょう" },
	["hy_zodiac3"] = { name = "Shipping Forecast", desc = "黄道十二宮のモチーフが水圧転写されている。\n\n未来のことなんて誰にも分らない" },
	["so_khaki_green"] = { name = "Para Green", desc = "パーツごとにカーキグリーンと黒のスプレーペイントを使用。\n\n過去の彼がどうであろうと、今の彼が変わることはない。心配ない、フェリックス... 彼はこの手で止める。―「パラディンと教師」その2" },
	["cu_anime_aug"] = { name = "Akihabara Accept", desc = "熱転写フィルムでアニメ雑誌の表紙をデコレーション。\n\nヤッター！" },
	["am_bamboo_jungle"] = { name = "Hydroponic", desc = "竹をモチーフにメタリック塗料でペイント。\n\nガンスミスのユカコは AK-47 の木製パーツを活かしてエコなテーマ性を前面に押し出してる... このモデルは自然と同じで美しいけれど、命取りにもなる。そこを忘れないで。―武器商人見習い イモジェン" },
	["hy_bamboo_jungle_ink"] = { name = "Bamboo Print", desc = "筆で描かれた竹の絵が水圧転写されている。\n\nありったけ撃ち込め、竹だけに" },
	["hy_bamboo_jungle_black"] = { name = "Bamboo Shadow", desc = "筆で描かれた竹の絵が水圧転写されている。\n\nコタロウはこの銃によって息子の命を奪われた... いつの日か、彼はこれを使って犯人の息の根を止めるだろう" },
	["hy_bamboo_jungle"] = { name = "Bamboo Forest", desc = "筆で描かれた竹の絵が水圧転写されている。\n\nやはりパンダのほうがいいと思うんだが。―武器商人 ブース" },
	["am_geometric_steps"] = { name = "Aqua Terrace", desc = "メタリック塗料で幾何学的なモチーフが描かれている。\n\nようやく静かに..." },
	["hy_geometric_steps"] = { name = "Geo Steps", desc = "幾何学的なモチーフが水圧転写されている。" },
	["hy_geometric_steps_green"] = { name = "Counter Terrace", desc = "幾何学的なモチーフが水圧転写されている。\n\nねえサブリ、これを使うといいよ... あんたに負けないくらいやかましいから。―救出スペシャリスト カルメン・コシネロ" },
	["hy_geometric_steps_yellow"] = { name = "Terrace", desc = "幾何学的なモチーフが水圧転写されている。\n\nヴァレリア、人を信じすぎないほうがいい... 命取りになるぞ。―フェニクス参謀 フランツ・クリーゲルド" },
	["hy_kimono_diamonds"] = { name = "Neon Kimono", desc = "幾何学的なモチーフが水圧転写されている。\n\n負担になることは分かっている。あなたにとってターナーは息子同然だったから... ―「パラディンと教師」その1" },
	["hy_kimono_diamonds_orange"] = { name = "Orange Kimono", desc = "幾何学的なモチーフが水圧転写されている。\n\n伝統には力がある" },
	["hy_kimono_diamonds_red"] = { name = "Crimson Kimono", desc = "幾何学的なモチーフが水圧転写されている。\n\nターナー、壊せない人間などいない... 大事なのは、どこに圧力をかけるべきかを把握することだ。―「裏切者と探求者」その2" },
	["sp_kimono_diamonds"] = { name = "Mint Kimono", desc = "幾何学的なモチーフがスプレーペイントされている。\n\n来てよ、ブース。制作中の作品を見せてあげる。―ガンスミス ユカコ" },
	["am_seastorm"] = { name = "Midnight Storm", desc = "下地にブルーのメタリック塗料を使い、その上に荒波が水圧転写されている。\n\nセバスチャン、あんたを憎んではいない... ただ憐れんでいるだけだ。―タスクフォース離反者 チェイス・ターナー" },
	["am_seastorm_blood"] = { name = "Sunset Storm 壱", desc = "下地に赤のメタリック塗料を使い、その上に荒波が水圧転写されている。\n\n同じだと思うなら、もう一度よく見ることだ... わずかなディテールが大きな違いを生む" },
	["am_seastorm_shojo"] = { name = "Sunset Storm 弐", desc = "am_seastorm_shojo" },
	["am_kimono_sunrise"] = { name = "Daybreak", desc = "メタリック塗料で朝日が描かれている。\n\n太陽は正しき者も悪しき者も等しく照らす" },
	["am_so_keycolors"] = { name = "Impact Drill", desc = "am_so_keycolors" },
	["so_aqua"] = { name = "海鳥", desc = "パーツごとにアクアブルーと黄褐色の配色でスプレーペイントされている。\n\n渡さない" },
	["cu_ak47_courage_alt"] = { name = "Aquamarine Revenge", desc = "イルカの集団を描いたカスタムペイント。\n\nここ、エコーかかってる？" },
	["cu_cz75a_chastizer"] = { name = "Yellow Jacket", desc = "曲線が目立つカスタムペイント。\n\n蝶のように舞い、無慈悲な怒れる虫のように刺す" },
	["am_famas_dots"] = { name = "Neural Net", desc = "下地にメタリック塗料を使い、上から半透明の水圧転写を施している。\n\n分かってる。でもあれは正しい判断だった... ―「家庭の事情」その2" },
	["cu_galilar_particles"] = { name = "Rocket Pop", desc = "ストライプとピクセルの断片をデザインしたカスタムペイント。\n\n夏の暑い日にぴったり" },
	["aq_glock18_flames_blue"] = { name = "Bunsen Burner", desc = "緑青加工をした後でスライドを研磨し、炎のデザインを浮かび上がらせている。\n\nコンコン" },
	["cu_m4a4_evil_daimyo"] = { name = "Evil Daimyo", desc = "赤と黒で構成されたグラフィックデザイン。\n\nカルメン、奴を見つけた... ―「鬼とヴァルキリー」その1" },
	["cu_mp7_nemsis"] = { name = "Nemesis", desc = "金属のモンスターを描いたカスタムペイント。\n\nヤツが来る" },
	["am_mp9_nitrogen"] = { name = "Ruby Poison Dart", desc = "黒の下地の上に赤と紫のメタリック塗料でペイントされている。\n\nダイヤモンドは女子の一番の友達だなんて誰が言ったんだ？" },
	["cu_negev_annihilator"] = { name = "Loudmouth", desc = "大きな口をペイントした後でダメージ加工を施している。\n\n戻ってこい、そうだ、お前に言っている！" },
	["cu_nova_ranger"] = { name = "Ranger", desc = "刷毛のペイントを水圧転写し、熱転写デカールのディテールを入れている。\n\nスコアをつけているのは誰だ？" },
	["aq_p2000_boom"] = { name = "Handgun", desc = "拳銃のかたちにした手を描いたカスタムペイント。\n\nお遊びはおしまいだ" },
	["cu_ump45_uproar"] = { name = "Riot", desc = "水圧転写と熱転写デカールを組み合わせた作品。\n\n巻き添えを出したくないなら、もっと細かいところまで詰めておけばよかたんだ... ―フェニックスの拳 ハビエル・アルビソ" },
	["cu_usp_progressiv"] = { name = "Torque", desc = "黒、白、黄色のモダンなカスタムペイント。\n\nコタロウ、連中は君を操っている。それを自覚できないのであれば、思ってもいないトラブルに巻き込まれることになるぞ... ―指揮官 フェリックス・ライリー" },
	["cu_ak47_winter_sport"] = { name = "Frontside Misty", desc = "生きいきとしたアイスカラーのペイント。\n\n雪のなかでの仕事は気に入っている。鮮やかな光景ができあがるからね。―フェニックスの拳 ハビエル・アルビソ" },
	["cu_dualberretta_dragons"] = { name = "Dualing Dragons", desc = "スライドとバレルに龍の絵がレーザー彫刻されている。\n\nマリアンはいつだってシルビアより格好良かった" },
	["cu_famas_lenta"] = { name = "Survivor Z", desc = "マスキングテープを使ってステンシルし、その後ダメージ加工を施している。\n\n赤と白でフルオート射撃するものなーんだ？" },
	["gs_g3sg1_flux_purple"] = { name = "Flux", desc = "紫とシルバーのメタリック塗料でペイントされている。\n\n計画とは実現しない物事のことだ" },
	["gs_galil_nightwing"] = { name = "Stone Cold", desc = "ブルーのメタリック塗料でハイライトし、ストックとマガジンにデザイナーのロゴがあしらわれている。\n\n人は遅かれ早かれ、師の傘の下から出て行かねばならない" },
	["gs_glock18_wrathys"] = { name = "Wraiths", desc = "スライド部分に亡霊の姿が描かれている。\n\nはじめに帳を貫き、次いで影を貫く" },
	["gs_m249_nebula_crusader"] = { name = "Nebula Crusader", desc = "クラシックなアーケードゲームの筐体をイメージしたカスタムペイント。\n\n遊んでもいいが、コインを用意しておけよ" },
	["gs_m4a1s_snakebite_gold"] = { name = "Golden Coil", desc = "襲いかかる蛇を描いた水圧転写ペイント。\n\n毒蛇はどこからでも襲ってくる" },
	["cu_mac10_alekhya_duo"] = { name = "Rangeen", desc = "古代エジプトモチーフのカスタムペイント。\n\n怒りに満ちたこの眼差しに耐えられるか？" },
	["cu_mag7_myrcene"] = { name = "Cobalt Core", desc = "未来的なデザインのカスタムペイント。\n\nカルメン、彼を守ってやれ。―「ヴァルキリーと愛人」その1" },
	["cu_mp7_classified"] = { name = "Special Delivery", desc = "[検閲により削除]―されている。\n\n望み通りにすれば解放してくれるんだな？―「不死鳥と語り手」その2" },
	["hy_p250_crackshot"] = { name = "Wingshot", desc = "水圧転写による鮮やかなカスタムペイント。\n\nちょっと突くだけで望むものが手に入るときもある。―フェニックス参謀 フランツ・クリーゲルド" },
	["gs_scar20_peacemaker03"] = { name = "Green Marine", desc = "メタリック塗料を用いた迷彩柄。\n\nいいか、諸君... イザキとコシネロは無許可離隊となったが、我々の任務は変わらない。アレックス・キンケイドの救出だ。―指揮官 フェリックス・ライリー" },
	["cu_ssg08_technicality"] = { name = "Big Iron", desc = "黄色とオレンジの水圧転写カスタムペイント。若干のダメージ加工を施している。\n\n疑惑の勝利でも勝ちは勝ちだよ。―期待の新星 ロナ・サブリ" },
	["cu_usp_kill_confirmed"] = { name = "Kill Confirmed", desc = "頭蓋骨を射貫く銃弾を描いたカスタムペイント。\n\n胸は2発、頭は1発" },
	["aq_xm1014_scumbria"] = { name = "Scumbria", desc = "メタリック塗料による繊細なペイントワーク。\n\n焦りは禁物だ。別の方法でヴァレリアの注意を引けるかもしれない... ―「父の愛」その3" },
	["cu_ak47_point_disarray"] = { name = "Point Disarray", desc = "水圧転写による幾何学模様のカスタムペイント。\n\n間近から見るとぐちゃぐちゃでも、遠くから見ると美しい。―フェニックス参謀 フランツ・クリーゲルド" },
	["am_aug_jumble"] = { name = "Ricochet", desc = "2色のノットワーク柄のカスタムペイント。\n\nコタロウは保護なんて求めてない。―「ヴァルキリーと愛人」その2" },
	["cu_bizon_noxious"] = { name = "Fuel Rod", desc = "弾薬が放射線を浴びたかのように錯覚させるカスタムペイント。\n\n下っ端のほうが有利なときもある" },
	["aq_deagle_corinthian"] = { name = "Corinthian", desc = "レーザー彫刻が施され、グリップはレザーでカスタマイズしている。\n\n保護、希望、信頼、辛抱" },
	["cu_fiveseven_retrobution"] = { name = "Retrobution", desc = "レトロデザインの水圧転写カスタムペイント。\n\n時代遅れにならないものもある" },
	["cu_g3sg1_executioner"] = { name = "The Executioner", desc = "毒々しい骨の手描きペイント。\n\n必ず何かしら戦利品を持ち帰るんだ。―フェニックスの拳 ハビエル・アルビソ" },
	["gs_m4a4_royal_squire"] = { name = "Royal Paladin", desc = "手間暇をかけて壮麗な彫刻とペイントを施している。\n\nこの通話はなかったことにするように。いいな？―「パラディンと父」その1" },
	["cu_negev_impact"] = { name = "Power Loader", desc = "重機を連想させる水圧転写カスタムペイント。\n\n女王が恐れ、司教が愛した" },
	["am_p2000_imperial_red"] = { name = "Imperial", desc = "レーザー彫刻され、赤と黄色のメタリック塗料でペイントされている。\n\n私の気持ちなどどうでもいいんだ、キオ。帝国を守れればそれでいい。―武器商人 ブース" },
	["cu_p90_shapewood"] = { name = "Shapewood", desc = "手作業で削り、研磨し、ラミネート加工した木製ストックが特徴。\n\nピンセットは付属していない" },
	["gs_sawedoff_necromancer"] = { name = "Yorick", desc = "頭蓋骨を水圧転写し、ゴールドのアクセントを手描きで入れている。\n\nローゼンクランツとギルデンスターンにはどうしようもなかった..." },
	["hy_scar20_jungler"] = { name = "Outbreak", desc = "生命力を感じるグリーン基調のペイント。\n\nヴァレリアはますます大胆になっている。今こそ正面きって戦いを挑まねば。―指揮官 フェリックス・ライリー" },
	["gs_sg553_tiger_moth"] = { name = "Tiger Moth", desc = "蛾の羽の柄を用いたカスタムペイント。\n\nヴァレリアはますます大胆になっている。今こそ正面きって戦いを挑まねば。―指揮官 フェリックス・ライリー" },
	["cu_tec9_avalanche"] = { name = "Avalanche", desc = "未来的なデザインの水圧転写カスタムペイント。\n\n彼女が相手である以上、賢明に立ち回らなければ。一歩間違えば二人そろって潰されかねない。―「蛇と真実の探求者」" },
	["aq_xm1014_hot_rod"] = { name = "Teclu Burner", desc = "メタリック塗料で炎を表現。\n\nブンゼンバーナーでは火力が足りないときがある" },
	["gs_ak47_supercharged"] = { name = "Fuel Injector", desc = "ボディ部分は明るい黄色でペイントされ、弾倉はマシン風にカスタムペイントされている。\n\n人生フルオートで生きねえとな" },
	["cu_bizon_citizen"] = { name = "Photic Zone", desc = "迷彩柄に蛍光色のアクセントを入れたカスタムペイント。\n\n波の砕ける音ではなさそうだ..." },
	["aq_deserteagle_kumichodragon"] = { name = "Kumicho Dragon", desc = "スライドとグリップに龍の図柄がレーザー彫刻されている。\n\nユカコさん、あんたのファンなんだ。話したいことがある... ―競合者 ハクスリー" },
	["cu_fiveseven_augmented"] = { name = "Triumvirate", desc = "水圧転写されたライトブルーのデジタルディストラクティブパターン (DDPAT) とスライド部分のカスタムペイントが特徴。\n\n戦争で儲けているわけじゃない、人間の性で儲けているだけだ。―武器商人 ブース" },
	["gs_glock18_award"] = { name = "Royal Legion", desc = "緻密な彫刻が施されている。\n\nナオミは自分がいつの日かヴァレリアのために死ぬことになると理解している" },
	["gs_m4a4_pioneer"] = { name = "The Battlestar", desc = "このモデルに限り八角形の納品書が届く。\n\n監視塔の話をする者に気をつけろ" },
	["am_mac10_electricity"] = { name = "Lapis Gator", desc = "鮮やかなワニ革の水圧転写ペイント。\n\nエアボートは別売り" },
	["gs_mag7_praetorian"] = { name = "Praetorian", desc = "メタリック塗料を使った独創的なデザイン。\n\n尖塔が形成されつつある" },
	["sp_mp7_impire"] = { name = "Impire", desc = "大量のインプが水圧転写で描かれている。\n\nカワイイ殺戮" },
	["cu_ssg08_necropos"] = { name = "Necropos", desc = "邪悪なルーンがペイントされている。\n\n大工にはハンマー、仕立て屋には紡錘が必要だ" },
	["gs_tec9_jambiya"] = { name = "Jambiya", desc = "中東風の柄が手描きとレーザー彫刻で表現されている。\n\nシェヘラザードは千物語を語ったが、お前が聞く物語はこれが最後だ。" },
	["gs_usp_voltage"] = { name = "Lead Conduit", desc = "サプレッサーとスライドに特別な彫刻が施されている。\n\nあんたは望んだものを手に入れた。それが何を意味するか分かるか？―武器商人 ブース" },
	["cu_aug_swallows"] = { name = "Fleet Flock", desc = "雲間を飛ぶ鳥たちが水圧転写で描かれている。\n\n調和と平和を象徴する鳥もいるが... この鳥は違う" },
	["cu_bizon_Curse"] = { name = "Judgement of Anubis", desc = "エジプトがテーマのカスタムペイント。\n\nその引き金は羽根より軽い" },
	["gs_cz75a_redastor"] = { name = "Red Astor", desc = "手描きで赤と白のアクセントを入れている。\n\nブースはまるでホームドラマの登場人物だ。真面目に仕事の話をしようってときにも茶番を持ちこんでくる。―競合者 ハクスリー" },
	["gs_dualberettas_ventilators"] = { name = "Ventilators", desc = "クロムでコーティングされたエレガントな逸品。\n\n芸術家による芸術家のための武器" },
	["sp_g3sg1_militiaorange"] = { name = "Orange Crash", desc = "ステンシルとオレンジ色のスプレーを使った個性的なライフル。\n\nこれであなたは現代のシアカーン" },
	["gs_galilar_incenerator"] = { name = "Firefight", desc = "えんじ色のアクセントに手描きのアイコンが特徴。\n\nブースはヴァレリアのためにこのモデルを委嘱し、フェニックスとの関係修復を図った" },
	["cu_m249_spectre"] = { name = "Spectre", desc = "シックで現代的なペイントが施されている。\n\nフェニックスの乱がはじまろうとしている" },
	["cu_m4a1s_soultaker"] = { name = "Chantico's Fire", desc = "鮮やかな色で手描きされており、ストックのスマイリーフェイスがアクセントになっている。\n\n自分のものは自分で守れ" },
	["am_mp9_bioleak"] = { name = "Bioleak", desc = "化学物質の流出事故を思わせる緑の濃淡が特徴。\n\n直接触れないこと！" },
	["hy_p2000_oceani"] = { name = "Oceanic", desc = "黒ベースにブルーのアクセントが目を引くデザイン。\n\nコタロウかカルメンと連絡を取った者はいないか？ ―指揮官 フェリックス・ライリー" },
	["cu_p250_asiimov"] = { name = "アシモフ", desc = "SFチックなデザインのカスタムペイント。\n\nライフルがなければ殺せないだと？ 私を誰だと思っている？ ―フェニックスの狙撃手 ミカ・ビトン" },
	["gs_sawedoff_fubar"] = { name = "Fubar", desc = "バレルに多くのカウントが記された歴戦のショットガン。\n\n衝撃とともに始まり、静寂で終わる" },
	["cu_sg553_atlas"] = { name = "Atlas", desc = "モダンな迷彩柄が水圧転写されている。\n\n当初は合同タスクフォース向けのデザインだったが、ハクスリーの企業スパイ活動によってフェニックス専用となった。" },
	["gs_ssg08_armacore"] = { name = "Ghost Crusader", desc = "白ベースにアイスブルーのアクセントが入っている。\n\n奪われたものを穴埋めすることはできないが... 奴らからさらに多くを奪うことはできる。―「不死鳥と新入り」その2" },
	["am_tec9_redblast"] = { name = "Re-Entry", desc = "バレルに炎のデカールが貼られている。\n\nいつも正しい自分でいるのって、ほんと大変。―救出スペシャリスト カルメン・コシネロ" },
	["cu_ump45_primalsaber"] = { name = "Primal Saber", desc = "サーベルタイガーの頭蓋骨を描いたデカールが貼られている。\n\nどんな捕食者にも死は訪れる" },
	["cu_xm1014_spectrum"] = { name = "Black Tie", desc = "黒と白のクロムでフォーマルな装いにもマッチするショットガン。\n\nイザキとコシネロを確保した。使い道がないなら今ここで殺すが、どうする？ ―「傭兵と蛇」その1" },
	["cu_lore"] = { name = "Lore", desc = "ノットワーク柄のカスタムペイント。" },
	["cu_stonewash"] = { name = "Black Laminate", desc = "ストーンウォッシュ加工され、ハンドル部分に黒ラミネートを使用。" },
	["am_marbleized_g"] = { name = "Gamma Doppler", desc = "黒とシルバーのメタリック塗料をマーブリングし、さらにキャンディコーティングを施している。" },
	["gs_autotronic"] = { name = "Autotronic", desc = "アルマイト加工によって赤くし、スチールメッシュを使って軽量化している。" },
	["am_marked_up"] = { name = "Freehand", desc = "黒と紫にペイントし、メタリックマーカーで装飾を入れている。" },
	["gs_aug_aristocrat"] = { name = "Aristocrat", desc = "ライトブルーのアルマイト加工ベースの上に銀線細工があしらわれている。\n\n上位1%の選民のために" },
	["gs_awp_phobos"] = { name = "Phobos", desc = "金属パネルと頑丈な電子部品で構成されている。\n\nより良き世界を築こう" },
	["cu_five_seven_daimyo"] = { name = "Violent Daimyo", desc = "黒とバイオレットのグラフィックデザイン。\n\nいかに統治すべきか..." },
	["cu_glock_wasteland_rebel"] = { name = "Wasteland Rebel", desc = "ダメージ加工、ブロックプリントそしてグラフィティでカスタマイズ。\n\n貢物を渡せ" },
	["gs_m4a1_mecha_industries"] = { name = "Mecha Industries", desc = "硬質セラミックパネルで作られている。\n\n世界初の技術を採用" },
	["cu_m4a4_desolate_space"] = { name = "Desolate Space", desc = "宇宙をテーマにしたカスタムペイント。\n\n「通信が途絶えた...」" },
	["aq_mac_10_alien_camo"] = { name = "Carnivore", desc = "メタリック塗料の下地に赤と紫のデザインを水圧転写。\n\n下ごしらえを忘れずに" },
	["aq_nova_sci_fi"] = { name = "Exo", desc = "紫ベースの柄の上にシルバーパネルのモチーフが水圧転写されている。\n\n重要なのは中身だ" },
	["gs_p2000_imperial_dragon"] = { name = "Imperial Dragon", desc = "赤のメタリック塗料で龍を描いたカスタムペイント。\n\n西方を見よ" },
	["gs_p250_metal_panels"] = { name = "Iron Clad", desc = "リベット留めされた金属パネルの装飾が特徴。\n\n信頼性・安全性ともに文句なし" },
	["gs_p90_full_throttle"] = { name = "Chopper", desc = "オレンジとブルーのメタリック塗料で炎を表現。\n\nクラッチ不要" },
	["gs_pp_bizon_harvester"] = { name = "Harvester", desc = "バイオメカをモチーフにした装飾。\n\nバイオメカニクスの実験が... 成功しただと？" },
	["cu_r8_cybersport"] = { name = "Reboot", desc = "シルバーと黒のパネルに赤のアクセントを入れている。\n\n「一度オフにしてから点けてみたら？」" },
	["cu_sawed_off_lime"] = { name = "Limelight", desc = "ライムグリーンと白の曲線的デザイン。\n\n注目の的" },
	["gs_scar20_bloodsport"] = { name = "Bloodsport", desc = "赤と黒の水圧転写ペイントの上に白いロゴデカールが貼られている。\n\nCT側のスポンサーは..." },
	["cu_sg553_aerial"] = { name = "Aerial", desc = "シルバーとイエローで塗装され、白い翼のデカールが貼られている。\n\n航空優勢を確立せよ" },
	["am_tec_9_sea_salt"] = { name = "Ice Cap", desc = "青と白の抽象的なデザインが水圧転写されている。\n\n刃向かう連中は沈めてしまえ" },
	["bloodhound_black_silver"] = { name = "Charred", desc = "柔軟性のあるクラシックな黒レザー製。\n\nチャレンジコインもいいんだけど、裏拳を入れても血が出ないからね。―救出スペシャリスト カルメン・コシネロ" },
	["bloodhound_snakeskin_brass"] = { name = "Snakebite", desc = "レザーとヘビ革を使用している。\n\n正直言って... セルゲイを懐かしむ者などいない。―フェニックス参謀 フランツ・クリーゲルド" },
	["bloodhound_metallic"] = { name = "Bronzed", desc = "レザーをガンメタルとブロンズに染めている。\n\n狙撃手チェイス・ターナーはブラッドハウンド作戦の最中にその生涯を終えた" },
	["bloodhound_guerrilla"] = { name = "Guerrilla", desc = "茶色のレザーと迷彩プリントの合皮を使用している。\n\nヴァレリアは報復を企んでいる。それは間違いない... ―狙撃手 セバスチャン・エンケ" },
	["handwrap_leathery"] = { name = "Leather", desc = "レザーとガーゼ、そして悪意でできている。\n\n悪名を馳せろ" },
	["handwrap_camo_grey"] = { name = "Spruce DDPAT", desc = "外側のラップにはグレーのデジタル迷彩がスクリーンプリントされている。\n\nタフさを喧伝する者もいれば、黙って示す者もいる" },
	["handwrap_red_slaughter"] = { name = "Slaughter", desc = "真紅に染められたラップのせいで、どこまでがグローブでどこからが鮮血か判然としない。\n\n手を動かす仕事が好きじゃない奴なんているか？" },
	["handwrap_fabric_orange_camo"] = { name = "Badlands", desc = "拾い集めた素材で作った手作りのハンドプロテクター。\n\n合同タスクフォースには未認可のボクシングリーグが存在するが、フェリックスは見て見ぬふりをしている" },
	["slick_black"] = { name = "Lunar Weave", desc = "ミッドナイトブルーのスウェードとジェットブラックのレザーを編み、時代を超えたスタイルを演出。\n\nこれで手を汚さずにすむ... 少なくとも物理的には。" },
	["slick_military"] = { name = "Convoy", desc = "茶色のソフトレザーと染色したスウェードを使用。\n\n現場の判断が求められることもある" },
	["slick_red"] = { name = "Crimson Weave", desc = "黒のスウェードと真紅のレザーを編み、時代を超えたスタイルを演出。\n\n指紋は残さず、爪痕を残せ" },
	["slick_snakeskin_yellow"] = { name = "Diamondback", desc = "なめし革、黒のレザー、ヘビ革で作られている。\n\n標準仕様なんてダサすぎる... ―武器商人見習い イモジェン" },
	["sporty_green"] = { name = "Hedge Maze", desc = "Icarus Athletics 製のグリーンと白のグローブ。\n\n臆病者でないなら、ビビらず太陽の近くを飛べ" },
	["sporty_purple"] = { name = "Pandora's Box", desc = "手のひらに繊細な柄がプリントされた黒と紫のグローブ。\n\n手汗をかきやすい爆破専門家の必需品" },
	["sporty_light_blue"] = { name = "Superconductor", desc = "目を見張る存在になりたい人に最適なブルーと黒のグローブ。\n\n彼らは関わりたくないらしい" },
	["sporty_military"] = { name = "Arid", desc = "トーンの異なるブラウンと控えめな迷彩プリントが洗練された雰囲気を漂わせる。\n\n英雄になるなら、それらしい出で立ちにしたほうがいいかもね。―期待の新星 ロナ・サブリ" },
	["specialist_ddpat_green_camo"] = { name = "Forest DDPAT", desc = "使用感のあるデジタル迷彩生地と手縫いのレザーのコンビネーション。\n\n自分の手を汚したくない人もいる" },
	["specialist_kimono_diamonds_red"] = { name = "Crimson Kimono", desc = "真っ赤なダイヤモンド柄のアクセントを入れた黒ベースのグローブ。\n\nだんだんと怒りの色が露わに" },
	["specialist_emerald_web"] = { name = "Emerald Web", desc = "甲の部分に蜘蛛の巣の柄が入れられている。\n\n規律が成功を生む" },
	["specialist_white_orange_grey"] = { name = "Foundation", desc = "白と黒のグローブにオレンジ色のアクセントを追加。\n\nTortue は Asiimov シリーズの武器デザインから着想を得たと言われている。" },
	["motorcycle_basic_black"] = { name = "Eclipse", desc = "Tortue の名を世に知らしめた、黒ベースのオリジナルデザイン。\n\n「中年の危機」とか、ひと括りにしないでほしいね" },
	["motorcycle_mono_boom"] = { name = "Boom!", desc = "コミック風の擬音が所狭しと並べられている。\n\nPOW! BOOM! BIFF!" },
	["motorcycle_mint_triangle"] = { name = "Spearmint", desc = "着け心地がよく、白のレザーと赤のステッチがスタイリッシュ。\n\nハクスリーめ、強気な値付けをしているのだから、おまけとしてミントタブレットぐらい入れてこいよ... ―指揮官 フェリックス・ライリー" },
	["motorcycle_triangle_blue"] = { name = "Cool Mint", desc = "ブルーのソフトレザーにアイスカラーの幾何学模様があしらわれている。\n\nすっきり爽やかに戦いたいあなたに" },
	["slick_snakeskin_white"] = { name = "King Snake", desc = "白いレザーとヘビ革で作られている。" },
	["slick_plaid_purple"] = { name = "Imperial Plaid", desc = "フランネルとレザーを用いた高貴な色合いのグローブ。" },
	["slick_stitched_black_orange"] = { name = "Overtake", desc = "黒レザーとタンレザーを使ったスピード感重視のグローブ。" },
	["slick_slick_stitched_green_grey"] = { name = "Racing Green", desc = "グレーの革を編みこんでシェブロン模様をあしらった深緑色のグローブ。" },
	["sporty_poison_frog_blue_white"] = { name = "Amphibious", desc = "ブルーと白の合成素材でできたグローブ。通気性と速乾性に優れている。" },
	["sporty_poison_frog_red_green"] = { name = "Bronze Morph", desc = "赤と緑の合成素材でできたグローブ。通気性と速乾性に優れている。" },
	["sporty_black_webbing_yellow"] = { name = "Omega", desc = "黒の合成素材でできたグローブ。黄色のアクセントが目を引く。" },
	["sporty_blue_pink"] = { name = "Vice", desc = "鮮やかなピンクとブルーのテクニカルファブリックを用いたグローブ。" },
	["motorcycle_choco_boom"] = { name = "POW!", desc = "鮮やかな色合いのコミック風の擬音が所狭しと並べられている。" },
	["motorcycle_basic_green_orange"] = { name = "Turtle", desc = "グリーンとグレーを基調とし、明るいオレンジ色のアクセントが入っている。" },
	["motorcycle_yellow_camo"] = { name = "Transport", desc = "うっすらとデジタル迷彩が入っている。" },
	["motorcycle_trigrid_blue"] = { name = "Polygon", desc = "青の濃淡が特徴的な人工素材とレザーで作られたグローブ。" },
	["handwrap_leathery_fabric_blue_skulls"] = { name = "Cobalt Skulls", desc = "スカルモチーフをプリントした青のバイアステープ製ラップ。" },
	["handwrap_leathery_fabric_geometric_blue"] = { name = "Overprint", desc = "黒のバイアステープ製ハンドラップに幾何学模様のゴム加工プリントが施されている。" },
	["handwrap_leathery_ducttape"] = { name = "Duct Tape", desc = "ありあわせの素材で作ったハンドラップ。耐久性は驚くほど高いが通気性は乏しい。" },
	["handwrap_leathery_fabric_green_camo"] = { name = "Arboreal", desc = "フォレスト迷彩に染めたバイアステープ製ハンドラップ。" },
	["bloodhound_hydra_black_green"] = { name = "Emerald", desc = "柔軟性のあるクラシックな黒レザー製。ニス加工した緑色のエンブレムがついている。" },
	["bloodhound_hydra_green_leather_mesh_brass"] = { name = "Mangrove", desc = "レザーと合成メッシュと真鍮を組み合わせて作られた。" },
	["bloodhound_hydra_snakeskin_brass"] = { name = "Rattler", desc = "レザーとヘビ革と真鍮を組み合わせて作られた。" },
	["bloodhound_hydra_case_hardened"] = { name = "Case Hardened", desc = "玉虫色のメタリックプリントが特徴のビーガンレザー製グローブ。" },
	["specialist_webs_red"] = { name = "Crimson Web", desc = "蜘蛛の巣模様がゴム加工プリントされた赤とグレーのグローブ。" },
	["specialist_forest_brown"] = { name = "Buckshot", desc = "狩猟テントにぴったりの実用的グローブ。" },
	["specialist_fade"] = { name = "Fade", desc = "メタリックなアクセントが入ったマルチカラーのグローブ。" },
