	["operation10_floral"] = { name = "Needle Point", desc = "" },
	["operation10_snakeskin_black"] = { name = "Unhinged", desc = "" },
	["cu_AK47_Anarchy"] = { name = "Neon Revolution", desc = "様々なものをより集めて水圧転写デカールを施し、ドリップペインティング。\n\nこれがなければ、決死隊は成立し得ない" },
	["gs_AUG_Syd_Mead"] = { name = "Syd Mead", desc = "著名なアーティストであるシド・ミードがカスタムデザインしたもの。\n\n彼はこれまで、私たちに未来のビジョンを示してきた。そして今は、未来を私たちの手に託している…" },
	["gs_CZ75_Tread"] = { name = "Imprint", desc = "労を惜しまず手作業でエッチングされたもの。\n\nオートクチュールの武器が、チェコ共和国を席巻している" },
	["aq_Desert_Eagle_Constable"] = { name = "Directive", desc = "銀色に輝く未来の警官による取り締まりをサポートする。\n\n次はお前だ…" },
	["gs_FAMAS_Rally"] = { name = "Roll Cage", desc = "泥が飛び散った車体のようなカスタムデカールを使用。\n\n安全第一" },
	["aq_Five_Seven_Scumbria"] = { name = "Scumbria", desc = "ばらばらのストライプ柄がペイントされている。\n\nフェリックス、彼を死なせるわけにはいかないんだ。彼を救わなくては。―「娘とパラディン」その1" },
	["gs_G3SG1_Ventilator"] = { name = "Ventilator", desc = "上品な黒とクロムでペイント。カスタムラバーストック付き。\n\nナオミ、心配いらない。フェリックスに思い知らせてやる。―フェニックスの狙撃手 ミカ・ビトン" },
	["cu_Glock18_Weasel"] = { name = "Weasel", desc = "いたずらっ子のイタチのボビーが水圧転写されている。ボビーにちょっかいをださないように。\n\nかわいいからといって、かみつかないわけではない" },
	["cu_MAG7_Tribal"] = { name = "Petroglyph", desc = "岩の彫刻を思わせるカスタムペイント。\n\n原始人が石つぶてを手にして以来、争いが絶えることはなかった。―武器商人 ブース" },
	["cu_MP9_Narcis"] = { name = "Airlock", desc = "白にペイントされ、真っ赤なマガジンが付けられている。\n\nトースターを撃つのに最適" },
	["hy_Negev_Dazzle"] = { name = "Dazzle", desc = "青と白の縞模様のデカールで覆われている。\n\nトリビア愛好家のための銃がついに登場" },
	["cu_P90_Grimm"] = { name = "Grim", desc = "殺気立った亡霊が水圧転写された上に、緑のアクセントがドライブラシで描かれている。\n\nイモジェン… あなたが売ろうとしてるのって銃なの？ それともビンテージのポスター？ ―期待の新星 ロナ・サブリ" },
	["gs_SCAR20_Powercore"] = { name = "Powercore", desc = "イエローのアクセントとグリーンでカスタムペイントされた後に、クイックチェックアウト用のUSBコードが付けられたもの。\n\nルール1―挑戦には達成感が必要だ" },
	["cu_SG556_Triarch"] = { name = "Triarch", desc = "王族から依頼を受けた砂漠迷彩柄のカスタムペイント。\n\nあなたの愛を彼らに思い出させて" },
	["gs_TEC9_Supercharged"] = { name = "Fuel Injector", desc = "ボディはイエローにペイントされ、マガジンにはベルトのエンジンが水圧転写されている。手縫いのレザーグリップで完成したシアトルの名作。\n\nピットクルーは含まれていません" },
	["cu_UMP45_Metritera"] = { name = "Briefing", desc = "地形図が水圧転写されている。\n\nこれはブリーフミーティングになりますが…" },
	["hy_XM1014_Fractal_Blue"] = { name = "Slipstream", desc = "スモーキーグレーと鮮やかなブルーでカスタムペイント。\n\n早まるな、エリオット。彼らにはまだ果たしてもらう役割がある…―「傭兵と蛇」その2" },
	["am_czv2_mf"] = { name = "Polymer", desc = "スライドにポリマーの化学式を思わせるデカールが貼られている。\n\nあなたはもうフェニックスと取り引きしなくて結構。自分たちの面倒は自分たちで見られる…―「娘とパラディン」その2" },
	["aq_glock_dark-fall"] = { name = "Ironwork", desc = "スライドにレーザーエッチングでツタとトゲが描かれている。\n\n手をかけなければ、どんな庭も大量の雑草で埋め尽くされてしまう" },
	["cu_ssg08_dragonfire_scope"] = { name = "Dragonfire", desc = "火を噴く巨大なドラゴンが水圧転写されている。\n\n宝の上に座り、宝を奪いに来る者を待て" },
	["gs_dual_berettas_golden_venice"] = { name = "Royal Consorts", desc = "緑に染めたパールハンドルのグリップ、グリフィンのサイドプレート、レーザーエッチングされたスライドのピストルが、ここにエレガンスを再定義。\n\n対峙し、ハトを解き放て" },
	["gs_famas_mecha"] = { name = "Mecha Industries", desc = "真っ白と黒のデザインでまるでSF番組から出てきたような雰囲気。\n\n青くつんつんとした髪型のやつと相棒のロボットは含まれません" },
	["gs_final_pooldeadv2"] = { name = "Cirrus", desc = "メタリックブルーでペイントされ、ドクロのデカールが使用されている。\n\n雲から頭を出せ" },
	["gs_g3sg1_viper_yellow"] = { name = "Stinger", desc = "イエローとグレーのアクセントが効いている。\n\n一瞬痛むだけ。ただそれだけ。" },
	["cu_galil_ar-camo"] = { name = "Black Sand", desc = "黒と迷彩柄のカスタムペイント。\n\nミカ・バトンが、合同タスクフォースに対抗して動こうとしている" },
	["aa_hide-mp9"] = { name = "Sand Scale", desc = "グレーとタンでカスタムペイント。\n\n我々は報復に備えなければならない。―指揮官 フェリックス・ライリー" },
	["cu_m4a1_flashback"] = { name = "Flashback", desc = "人間の二面性について提案するためにハンドペイントされたもの。\n\n私たちみんなの中のジョーカーに" },
	["gs_m4a4_sector"] = { name = "Buzz Kill", desc = "イエローとグリーンでスタイリッシュにペイントされた Sektor Industry の武器。\n\n興ざめなヤツはどこにでもいるが、こいつを食らえば目が覚める" },
	["am_mag7_malform"] = { name = "Sonar", desc = "ターコイズで軽くステンシルされたもの。\n\n確かに、敗北は初めての体験だ。―「鬼とヴァルキリー」その2" },
	["am_nova_sand"] = { name = "Gila", desc = "トカゲの皮のデカールで覆われている。\n\nまるでこれまで一度も傭兵に捕らわれたことがないような振る舞いだな。―「鬼とヴァルキリー」その1" },
	["gs_p2000-sport"] = { name = "Turf", desc = "グリップとスライドをメタリックグリーンでペイント。\n\n隣の芝生は常に赤いものだ" },
	["gs_p90_shallow_grave"] = { name = "Shallow Grave", desc = "グリップがルーン石碑のようにペイントされ、ストックにはガイコツが水圧転写されている。\n\nそれだけ死体を積み上げられたら、墓掘りが間に合わないだろ？" },
	["cu_usp_cyrex"] = { name = "Cyrex", desc = "控えめな赤いハイライトが施され、近未来のような雰囲気を醸し出している\n\nイモジェンは過去の人だよ、フェリックス。私が未来だ。―競合者 ハクスリー" },
	["cu_wp_sawedoff"] = { name = "Wasteland Princess", desc = "何者かによってバレルにキル数が記録されている。\n\nすべてを手にするサイコパスにぴったりの贈り物だ…" },
	["gs_ak47_bloodsport"] = { name = "Bloodsport", desc = "赤と黒の水圧転写の上に、白いロゴデカールが貼られている。\n\n求む、共同運転者" },
	["cu_awp_psychopath"] = { name = "Fever Dream", desc = "黒地にピンク、ブルー、パープルのイラストのカスタムペイント。\n\nせん妄は危険な状態です" },
	["hy_bizon_torn_green"] = { name = "Jungle Slipstream", desc = "グリーンとイエローの水圧転写でカスタムペイント。\n\nリーダーに続け" },
	["cu_blueprint_scar"] = { name = "Blueprint", desc = "ブルーを基調に建築家の設計図風にハンドペイント。\n\n最善の計画は縮尺どおりに描かれる" },
	["gs_cz_snakes_purple"] = { name = "Xiangliu", desc = "パープルとゴールドの9匹のヘビがカスタムペイント。\n\n満ち潮に注意" },
	["gs_m4a1_decimator"] = { name = "Decimator", desc = "最高に先鋭的なブルーとピンクのハイライトのカスタムペイント。\n\n静かなレトロフューチャリズム" },
	["cu_desert_eagle_corroden"] = { name = "Oxide Blaze", desc = "錆色の下地と白いディテールでカスタムペイント。\n\nサンドペーパーで整えられないものなどない" },
	["cu_fiveseven_vein"] = { name = "Capillary", desc = "青緑とコーラルピンクで入り組んだ血管を描いたカスタムペイント。\n\n20/100" },
	["sp_galil_wave"] = { name = "Crimson Tsunami", desc = "えんじ色の上に青い波模様がスプレーペイント。\n\n西向きのブレイク" },
	["sp_m249_frog_original"] = { name = "Emerald Poison Dart", desc = "ヤドクガエルにインスパイアされた水圧転写でペイント。\n\n保護が優先事項ではありません" },
	["sp_mp7_tribal_yellow"] = { name = "Akoben", desc = "イエローの下地の上にブルーの模様がスプレーペイント。\n\nあなたの私的なバトルクライ" },
	["am_p250_sputnik"] = { name = "Ripple", desc = "黒地に青灰のアルマイト加工が重ねられている。\n\n小石となれ" },
	["aa_mac10_the_last_dive"] = { name = "Last Dive", desc = "グリーンとオレンジのランダムな模様をハンドペイント。\n\n混沌の中にある美" },
	["gs_ump_abyss"] = { name = "Scaffold", desc = "青緑でハンドペイントされ、圧倒的な奥行き効果が得られている。\n\nレンガを一つ一つ" },
	["cu_usps_noir"] = { name = "Neo-Noir", desc = "グレースケールの背景の上に、スタイリッシュなブルーマゼンタの女性がカスタムペイント。\n\n「彼女はネオンの輝きに浸りながら、圧迫感のある超高層ビルの足元に横たわっている」" },
	["aq_xm_leaf_fade"] = { name = "Seasons", desc = "ランダムなマルチカラーのリーフ模様をハンドペイント。\n\n春、夏、秋、そしてたまに冬" },
	["aq_sawedoff_zander2"] = { name = "Zander", desc = "人気のゲームフィッシュ風にハンドペイント。\n\nこれはキープで" },
	["hy_p90_barebones_blue"] = { name = "Death Grip", desc = "ブルーの下地に重なり合う手の模様が水圧転写されている。\n\n静かに逝かないで" },
