	["hy_brush_camo_tan"] = { name = "Desert Brush", desc = "サンドカラーの模様を水圧転写。\n\nカモフラージュ効果テスト v.1" },
	["hy_ddpat_urban_red"] = { name = "Red DDPAT", desc = "赤のデジタル迷彩 (DDPAT) を水圧転写。\n\nピクセルが見える距離まで近づいたときにはもう手遅れだ。" },
	["hy_dry_wood"] = { name = "Spalted Wood", desc = "乾燥した木材を連想させる水圧転写ペイント。\n\n木を叩いて厄払いしておけ。乗り切るためには運も必要だ。―指揮官 フェリックス・ライリー" },
	["hy_desert_multicam"] = { name = "Black & Tan", desc = "黒と褐色のマルチカム迷彩が水圧転写されている。\n\n撃たなきゃ外すこともない" },
	["hy_torn_camo_paints"] = { name = "Quick Sand", desc = "ストックとレシーバーに黄褐色とブルーの模様を水圧転写し、バレルはダークブルーに塗装している。\n\n控えめに言って「眼福」そのものだ" },
	["sp_moro_carving_lightblue"] = { name = "New Roots", desc = "蔦と花の図案をグリーン系のスプレー塗料で描いている。\n\n伸びしろはある" },
	["sp_moro_carving_yellow"] = { name = "Old Roots", desc = "蔦と花の図案をグリーン系のスプレー塗料で描いている。\n\n「世間も認める」「経験豊富な」「百戦錬磨の」...... 要するに「年老いた」ということだ" },
	["sp_moro_textile_purple_yellow"] = { name = "Withered Vine", desc = "花の図案を紫とゴールドのスプレー塗料で描いている。\n\n不愉快という人もいるが、美しいと思う" },
	["sp_palm_night"] = { name = "Midnight Palm", desc = "グレーと紫の迷彩柄の上にヤシの葉が黒のスプレー塗料で描かれている。\n\n「看板が \"準備中\" になってる！」" },
	["sp_desert_skulls"] = { name = "Bleached", desc = "動物の頭蓋骨を描いたスプレーペイント。\n\n残るものといえば" },
	["sp_zebracam_red"] = { name = "Prey", desc = "シマウマの模様がラストカラーでスプレーペイントされている。\n\n食って、寝て、狩って、また食って" },
	["cu_ssg08_scorpion"] = { name = "Death Strike", desc = "ダイオウサソリと流れる砂をカスタムペイントした SSG 08。\n\n刺されたらキツそうだ..." },
	["hy_desert_bloom"] = { name = "Parched", desc = "乾いてひび割れた地面に生えるみずみずしい花を描いたスプレーペイント。\n\n自然には敵わない" },
	["am_ddpat_purple"] = { name = "Purple DDPAT", desc = "紫のデジタル迷彩 (DDPAT) を水圧転写。\n\nピクセルが見える距離まで近づいたときにはもう手遅れだ。" },
	["gs_awp_hydra"] = { name = "Desert Hydra", desc = "バレルに向かって這う金色のヘビが描かれた AWP。スコープ、バレル、銃床は白でペイントされている。\n\n首を1つ刎ねても、そこから2つ生えてくる。そんなリスクを負うつもり？ ―革命家 ヴァレリア・ジェンナー" },
	["gs_deagle_fennec"] = { name = "Fennec Fox", desc = "バレルにフェネックを描いたカスタムペイント。グリップには青緑とオレンジのデザインが施されている。\n\nおまえの声をよく聞きたいからだよ" },
	["am_mirage_flowers_metalic"] = { name = "Music Box", desc = "ゴールドのダマスク柄が特徴。\n\n空想の世界から闘争の世界へ" },
	["am_moro_textile_bright"] = { name = "Elegant Vines", desc = "赤と緑の花柄。\n\n不愉快という人もいるが、美しいと思う" },
	["am_navy_shine"] = { name = "Navy Sheen", desc = "アルマイト加工を施した紺色のVariCamo迷彩。\n\nなぜそんなにブルーなんだい？" },
	["gs_aug_sand_storm"] = { name = "Sand Storm", desc = "夜空の下を駆け抜ける砂嵐を描いたカスタムペイント。\n\nよおく気をつけて見てごらん、ぼくらのまわりはうつくしさであふれている" },
	["sp_dry_wood"] = { name = "Drift Wood", desc = "乾燥した木材を連想させる茶系のスプレーペイント。\n\n木を叩いて厄払いしておけ。乗り切るためには運も必要だ。―指揮官 フェリックス・ライリ" },
	["sp_desert_skulls_dawn"] = { name = "Drought", desc = "動物の頭蓋骨を描いたスプレーペイント。\n\n残るものといえば" },
	["sp_mirage_flowers_tan"] = { name = "Sienna Damask", desc = "黄褐色の下地の上にダマスク柄がスプレーペイントされている。\n\n誰にも気づかれない迷彩こそが、最高の迷彩といえよう..." },
	["sp_moro_carving_burnt"] = { name = "Humidor", desc = "蔦と花の図案を茶色と紫のスプレー塗料で描いている。\n\n「そこに何を保管しているんだ？」" },
	["sp_moro_textile_green_vine"] = { name = "Verdant Growth", desc = "花の図案をグリーン系のスプレー塗料で描いている。\n\n不愉快という人もいるが、美しいと思う" },
	["gs_mp5_neon_flektarn"] = { name = "Oxide Oasis", desc = "オレンジと青緑の明るい迷彩柄。仕上げにゴールドのアクセントを入れている。\n\nせっかく音を抑えたのに目立ってしょうがない" },
	["aa_desert_bloom_bright"] = { name = "Desert Blossom", desc = "乾いてひび割れた地面に生えるみずみずしい花を描いたスプレーペイント。\n\n自然には敵わない" },
	["hy_lizard_skin"] = { name = "Anolis", desc = "緑と黒の水圧転写でトカゲの鱗を表現している。\n\n1/1スケールで描写" },
	["cu_ak-47_phantom_disruptor"] = { name = "Phantom Disruptor", desc = "マットブラックの下地に霧の幻影を描いたカスタムペイント。\n\n「それは望む姿になり、望む場所に行ける。にもかかわらず、あなたと共にいることを選んだのだ...」" },
	["gs_aug_thunderstorm"] = { name = "Tom Cat", desc = "ガンメタルの下地にゴールドのハイライトを入れ、銃床に向かって伸びる矢印とイタズラ猫が描かれている。\n\n自然が喉を鳴らすと、それが雷雨になる" },
	["cu_awp_vein"] = { name = "Capillary", desc = "青緑とコーラルピンクで入り組んだ血管を描いたカスタムペイント。\n\nエージェントのハートを開く鍵、今なら $4750 でお求めになれます" },
	["cu_cz75_cerakote"] = { name = "Distressed", desc = "赤銅色のセラミック仕上げが施されているが、使い込まれて摩耗している。\n\n年月とともに味わいが増す" },
	["cu_deagle_replica"] = { name = "Blue Ply", desc = "ラミネート加工され、グリップは灰色、スライドは青にカラーリングされている。\n\n警告: これはレプリカであり、実弾でのテストは行われていません" },
	["cu_m4a1s_csgo2048"] = { name = "Player Two", desc = "明るい色合いでアニメ調の GIGN CT と Pop Dog を描いたカスタムペイント。\n\nスタートボタンを押してください..." },
	["cu_mac10_nacre"] = { name = "Disco Tech", desc = "自己接着ビニールのホログラムを模したパール光沢仕上げのカスタムペイント。\n\nそれをどこかに向けるときは気をつけて" },
	["gs_mag7_justice"] = { name = "Justice", desc = "正義のタロットカードにインスピレーションを得てカスタムペイントされている。\n\n公平な裁きを" },
	["cu_mp5_desert_strike"] = { name = "Desert Strike", desc = "黄褐色と黒のハイテクデザインがカスタムペイントされている。\n\n最初の一撃、最後の一撃" },
	["cu_negev_prototype"] = { name = "プロトタイプ", desc = "最終的なデザインが決まるまでの仮作業として、白と赤のカスタムペイントが施されている。\n\nv1.2.1, PAT. 3422107" },
	["aq_p2000_acid_clover"] = { name = "Acid Etched", desc = "ランダムなマルチカラーデザインに珍しい四つ葉のクローバーがあしらわれている。\n\n運試ししてみるか？" },
	["gs_r8_leviathan"] = { name = "Bone Forged", desc = "グリップに古代の海洋生物の亡骸を描いたカスタムペイント。\n\n深海に潜むもの" },
	["cu_sawedoff_apocalypto"] = { name = "Apocalypto", desc = "紫色の外宇宙を背景に、爆弾のような惑星に向かって伸びる腐りかけの手を描いたカスタムペイント。\n\n「時間はあるか？」" },
	["gs_scar20_enforcer"] = { name = "Enforcer", desc = "武器の様々なパーツに夕陽のグラデーションを丁寧にペイント。\n\nSYMETRY SMART GUN CORP が自信をもってお届けするオートモデル" },
	["cu_sg553_darkwing"] = { name = "Darkwing", desc = "羽根だけでなく「ダーク」なモチーフの数々をあしらった赤と黒のカスタムペイント。\n\n目ざとく極めて危険――飛べない鳥のなかでもこれほど危険なやつはいない" },
	["cu_ssg08_fever_dream"] = { name = "Fever Dream", desc = "黒の下地にど派手なピンクとブルーと紫で落書きをしたカスタムペイント。\n\nH@@HH@H@H@HA!!" },
	["cu_glock18_warmaiden"] = { name = "Bullet Queen", desc = "黄色と黒の下地にワルそうな弾丸とピンクのジャケットを羽織った戦乙女が描かれている。\n\n「静かにしてくれたら撃つのをやめるよ」" },
	["cu_negev_ultralight"] = { name = "Ultralight", desc = "グレーのデジタル迷彩と青緑の矢印がカスタムペイントされている。\n\nライター持ってる？" },
	["cu_ak47_anubis"] = { name = "Legion of Anubis", desc = "生と死の均衡を表すエジプトの神、アヌビスとラーを描いたカスタムペイント。\n\n天秤をそちらの有利に傾けてくださるよう祈りなさい" },
	["aq_p2000_lost_world"] = { name = "Gnarled", desc = "グリップからスライドにかけて異形のエイリアンが手描きされた P2000。\n\n無限の虚空の奥深くより出でしもの" },
	["cu_mag7_monster_call"] = { name = "Monster Call", desc = "青で下地をペイントし、前景に水中生物を描いたカスタムペイント。\n\n隣のサカナはいつだってデカい" },
	["cu_printstream"] = { name = "Printstream", desc = "コントラストのはっきりした黒と白のカスタムペイントにパール光沢のハイライトを入れて仕上げている。\n\nWHITE_1; BLACK_1; PEARLESCENT_1;" },
	["cu_glock_eyecontact"] = { name = "Vogue", desc = "ポップアートにインスパイアされたカスタムペイントの Glock。スライドに描かれた目が印象的。\n\n「私を見て！ あなたを撃つ私を！」" },
	["gs_tec9_guerilla"] = { name = "Brother", desc = "茶色とゴールドの迷彩柄でペイントされ、リアサイトに下に T エージェントのロゴが入っている。\n\nケツは守ってやる" },
	["cu_mac10_isoonna"] = { name = "Allure", desc = "青緑の衣をまとった磯女とみられる女性と鯉、そして白波を描いたカスタムペイントの MAC-10。\n\n美は流血を招く" },
	["gs_sg553_rusty"] = { name = "Ol' Rusty", desc = "元々はよく磨かれたスチールだったが、湿気によって風合いが変わってしまった。トリガーケーシングの上には「Ol' Rusty」の文字が入っている。\n\n錆びていても、こいつがいれば寂しくない" },
	["cu_ssg08_mainframe"] = { name = "Mainframe 001", desc = "ブルー系とパープル系の色でハイテクモチーフを描いたカスタムペイント。\n\n「_001」にどんな秘密が？" },
	["cu_p250_cassette"] = { name = "Cassette", desc = "1990年代のカセットテープのケースにインスパイアされたカスタムペイント。\n\nテープを確認して" },
	["gs_p90_container"] = { name = "Freight", desc = "グラフィティで覆われた列車の車両をイメージしたカスタムペイント。\n\nアートは器物破損に該当しない" },
	["cu_xm1014_amulet_blue"] = { name = "Entombed", desc = "数千年の時を経て発掘された XM-1014。青の布地とエジプトモチーフがカスタムペイントされている。\n\nファラオに相応しい逸品" },
	["cu_m4a4_queenfairy"] = { name = "Tooth Fairy", desc = "切歯と大臼歯、そして愛らしさとは無縁の「歯の妖精」が描かれたカスタムペイント。\n\n自分の歯じゃなければいけないなんて、誰も言ってない..." },
	["gs_galil_phoenix"] = { name = "Connexion", desc = "白と赤の下地にフェニックスのロゴがスプレーペイントされている。\n\n奴らは切り札を使う気だ" },
	["gs_bizon_hellraider"] = { name = "Runic", desc = "謎のルーン文字とガトリングガンを模した弾倉が特徴のカスタムペイント。\n\n地獄を見せてやれ" },
	["gs_mp5sd_wasteland_legacy"] = { name = "Kitbash", desc = "20年にわたる MP5 デザインの集大成ともいえる、ダクトテープ、結束バンド、接着剤を使用したカスタムペイント。\n\n1回目（か2回目か3回目）で成功しなくても..." },
	["gs_awp_exoskeleton"] = { name = "Exoskeleton", desc = "連結された頭蓋骨の模様を金属パーツにプレスした AWP。\n\nフルパワーでいけ" },
	["gs_cz75_vendetta"] = { name = "Vendetta", desc = "彫りこみや落書きがそこかしこにある、年季の入ったモデル。\n\n欲しけりゃ俺の死体から奪いな" },
	["hy_p90_dino_rampage"] = { name = "Cocoa Rampage", desc = "恐竜のイラストがオリーブグリーンとゴールドで水圧転写されている。\n\n恐竜とエイリアンと彗星だって？ こりゃ大変だ！" },
	["gs_dual_elites_dezastre"] = { name = "Dezastre", desc = "黒と白と赤で構成されたハイテクデザインのカスタムペイント。\n\nメーカーのガイドラインを守って安全に使用すること" },
	["cu_five_seven_diary"] = { name = "Fairy Tale", desc = "プリンセスとユニコーンと美しい花、そして遠くに城を描いたカスタムペイント。\n\n「今日はすてきな一日になる――そんな予感がするの！」" },
	["gs_g3sg1_disrupt"] = { name = "Digital Mesh", desc = "赤、白、チャコールグレーのカスタムデジタル迷彩。\n\n複雑すぎて目が回る" },
	["gs_galil_vandal"] = { name = "Vandal", desc = "緑のコーティングの上に白の塗料で様々なデザインが描かれている。\n\n絵にはそれぞれ物語があり、他より記憶に残るものもある" },
	["cu_p250_infect"] = { name = "Contaminant", desc = "えんじ色のコーティングはあちこちがついばまれ、残った部分は腐敗が進み、使い道が限られている。\n\n見た通りのヤバさ" },
	["cu_m249_deep_relief"] = { name = "Deep Relief", desc = "上層はサンドカラーで、深くなるほど濃い緑色になる。触覚に訴えるカスタムペイント。\n\n何発当てれば中心にたどり着くのだろう？" },
	["cu_m4a4_cyberpunk"] = { name = "Cyber Security", desc = "M4 の黒いベースカラーの上に、斜めに伸びる青、赤、ゴールドの帯がカスタムペイントされている。\n\nお近くのサイバネティックス販売店で好評発売中" },
	["gs_mp5_conditionzero"] = { name = "Condition Zero", desc = "『Counter-Strike: Condition Zero』へのオマージュとなる青と黄色のカスタムペイント。\n\n「3 時の方向から RPG! 回避せよ! 」" },
	["cu_nova_polymer"] = { name = "Clear Polymer", desc = "ケーシングが透明で武器の内部が見える――かのように錯覚させるカスタムペイント。\n\n目標はクリアーだ" },
	["cu_glock_noir"] = { name = "Neo-Noir", desc = "グレースケールの背景にブルーとマゼンタの女性像が描かれたカスタムペイント。\n\n「状況は好転の兆しを見せ、彼女の中に希望が芽生え始めた。だが彼女が見上げると――」" },
	["cu_ssg08_chromatic"] = { name = "Parallax", desc = "位置をずらして塗装を施すことで立体視を可能にしたカスタムペイント。\n\n2発、1キル" },
	["gs_ump_gold_bismuth"] = { name = "Gold Bismuth", desc = "白と黒のベースコートでゴールドのビスマス柄を挟んでいる。\n\n「高級志向だな...」" },
	["cu_usp_krokos"] = { name = "Monster Mashup", desc = "ストリートアートにインスパイアされた緑色のモンスターが描かれているカスタムペイント。サプレッサーにはパール光沢仕上げを採用している。\n\nX__X" },
	["cu_csgo_camo"] = { name = "Global Offensive", desc = "青、黄色、グレーの迷彩カスタムペイント。\n\n「ファーストコンタクトはドイツのハルツ山地、現地時間17:25の見込み...」" },
	["am_authority_brown"] = { name = "Charter", desc = "黄褐色ベースで紋章や紙片、マグナカルタの章句などが描かれている。\n\n法的手続きは万人に適用される――あなたも例外ではない" },
	["hy_authority_purple"] = { name = "Magna Carta", desc = "紫色ベースで紋章や紙片、マグナカルタの章句などが描かれている。\n\n法的手続きは万人に適用される――あなたも例外ではない" },
	["am_intelligence_grey"] = { name = "Surveillance", desc = "地図の上に鳥瞰図のHUDを重ねたカスタムペイント。\n\n目標を捕捉" },
	["am_intelligence_orange"] = { name = "Threat Detected", desc = "地図の上に鳥瞰図のHUDを重ねたカスタムペイント。\n\n目標を捕捉" },
	["am_intelligence_magenta"] = { name = "Target Acquired", desc = "地図の上に鳥瞰図のHUDを重ねたカスタムペイント。\n\n目標を捕捉" },
	["am_numbers_bronze"] = { name = "The Bronze", desc = "ランダムな数字が様々な色でペイントされている。\n\n私と違って、数字は嘘をつかない" },
	["am_numbers_red_blue"] = { name = "Dispatch", desc = "ランダムな数字が様々な色でペイントされている。\n\n私と違って、数字は嘘をつかない" },
	["hy_numbers_green"] = { name = "Switch Board", desc = "ランダムな数字が様々な色でペイントされている。\n\n私と違って、数字は嘘をつかない" },
	["am_numbers_magenta"] = { name = "Prime Conspiracy", desc = "ランダムな数字が様々な色でペイントされている。\n\n私と違って、数字は嘘をつかない" },
	["aa_fade_red_blue"] = { name = "Berries And Cherries", desc = "スライド部分が赤と青で半々に塗り分けられている。\n\nイェイ！" },
	["cu_ump_crime_scene"] = { name = "Crime Scene", desc = "赤と青のベースカラーの上に黄色の規制テープがペイントされている。\n\n一帯を規制しろ、仕事の邪魔になる" },
	["am_m4a1s_bluesmoke"] = { name = "Blue Phosphor", desc = "クロムブルーのベースコートの上に、ブルーのメタリック塗料を何層も重ねている。\n\nブルーな気分？" },
	["cu_ak_xray"] = { name = "X-Ray", desc = "X線で内部が透けているように見えるカスタムペイントの AK-47。\n\nすべてが明るみに出されたとして、それを直視できるのか？" },
	["am_heist_plans_green"] = { name = "Heist", desc = "下地はアルマイト加工されたベージュ色の地図で、その上に書き込みがされているように見える。\n\n計画と実行は別物だ" },
	["am_heist_plans_purple"] = { name = "Night Heist", desc = "下地はアルマイト加工された紫色の地図で、その上に書き込みがされているように見える。\n\n計画と実行は別物だ" },
	["am_heist_plans_yellow"] = { name = "Vault Heist", desc = "下地はアルマイト加工されたグレーの地図で、その上に書き込みがされているように見える。\n\n計画と実行は別物だ" },
	["hy_houndstooth_brown"] = { name = "Houndstooth", desc = "茶色の千鳥格子が水圧転写されている。\n\n今の役割ではなく、自分のやりたい役割に合わせて装備しろ" },
	["gs_mac10_snake"] = { name = "Hot Snakes", desc = "ブロンズカラーのヘビ柄カスタムペイント。ワイヤーストックの下にとぐろを巻いたヘビが描かれている。\n\n威嚇音じゃない、銃弾が掠めていったんだ" },
	["hy_phoenix_tags_lilac"] = { name = "Phoenix Chalk", desc = "フェニックス・コネクションのグラフィティが様々な色で描かれている。\n\n「勝てると思っているなら、とんだバカだ！」" },
	["am_phoenix_tags_blue"] = { name = "Phoenix Marker", desc = "フェニックス・コネクションのグラフィティが様々な色で描かれている。\n\n「我々は止められない！」" },
	["hy_phoenix_tags_red"] = { name = "Phoenix Stencil", desc = "フェニックス・コネクションのグラフィティが様々な色で描かれている。\n\n「我々は不滅だ！」" },
	["sp_phoenix_tags_purple"] = { name = "Phoenix Blacklight", desc = "フェニックス・コネクションのグラフィティが様々な色で描かれている。\n\n「お前らの墓の上で踊ってやる！」" },
	["hy_tigers_tan"] = { name = "Clay Ambush", desc = "茶色と黄褐色で虎の絵が水圧転写されている。\n\n通常は単独で狩りをするが、お前を狩るときは別だ" },
	["am_tigers_brown"] = { name = "Tiger Pit", desc = "黒の下地に茶色と黄褐色で虎の絵が水圧転写されている。\n\nここだけは勘弁してくれ" },
	["am_tigers_blue"] = { name = "Silk Tiger", desc = "ブルーの下地に茶色と黄褐色で虎の絵が水圧転写されている。\n\nまさに国宝――AWP ではなく、虎のことだ" },
	["cu_m4a1_snake"] = { name = "Welcome to the Jungle", desc = "夕暮れ色に染まるジャングルを背景に古代の図像とゴールデン・ランスヘッドが描かれている。\n\n警告なしにひと咬み" },
	["cu_ak_jaguar"] = { name = "Panthera onca", desc = "人によっては側面にカスタムペイントされたジャガーより、ストックとハンドガードの木材に施された美麗な彫刻に目を奪われる。\n\n斑点を反転できないなんて誰が決めたんだ？" },
	["cu_jaguar_p90"] = { name = "Run and Hide", desc = "ジャガーの柄をカスタムペイントし、シボ加工のレザーで仕上げている。\n\n誰だってカネさえかければブランドものを買えるが、真にスタイルを確立している人は少ない" },
	["aa_ancient_brown"] = { name = "Ancient Earth", desc = "ブラウンとゴールド系統の色で繊細な線と古代生物の姿を描いている。\n\n特権はあなたのものだ" },
	["am_ancient_warm"] = { name = "Ancient Lore", desc = "淡い緑とベージュと赤で古代のタイル画を表現している。\n\n「間違った道から歩み始めた人にさえ、希望は残っている」" },
	["aa_ruins_green"] = { name = "Lush Ruins", desc = "生い茂る葉の奥に古代の神々がぼんやりと浮かび上がる。\n\n「注意しろ――監視されているぞ...」" },
	["hy_ancient_tiles_peach"] = { name = "Blast From the Past", desc = "淡い緑とベージュで古代のタイル画を表現している。\n\n「間違った道から歩み始めた人にさえ、希望は残っている」" },
	["am_gold_brick"] = { name = "Gold Brick", desc = "ゴールド仕上げのため光にかざすと輝き、この武器の不完全さを美しく際立たせる。\n\n輝くものは必ずしも..." },
	["sp_ancient_bright"] = { name = "Ancient Visions", desc = "緑と赤系統の色で繊細な線と古代生物の姿を描いている。\n\n特権はあなたのものだ" },
	["hy_ruins_red"] = { name = "Dusk Ruins", desc = "生い茂る葉の奥に古代の神々がぼんやりと浮かび上がる。\n\n「注意しろ――監視されているぞ...」" },
	["am_jade"] = { name = "Carved Jade", desc = "クロムの下地でペイントされ、透過性のあるジェイドグリーンのアルマイト加工が施されている。\n\n洗練の極み" },
	["am_ancient_wine"] = { name = "Ancient Ritual", desc = "えんじ色とシルバー系統の色で繊細な線と古代生物の姿を描いている。\n\n特権はあなたのものだ" },
	["hy_drywood_green"] = { name = "Tall Grass", desc = "緑の草の絵柄が水圧転写されている。\n\n草むらではロクなことが起きない" },
	["am_black_panther"] = { name = "Panther Camo", desc = "仕上げ加工でクロヒョウの斑点を表現。\n\nまだらな日陰で一休み" },
	["gs_ak47_professional"] = { name = "Slate", desc = "「スレートブラックにブラックとブラックを重ねた」としか言いようのないカスタムペイント。\n\n「医者が必要になるから呼んでおけ」" },
	["cu_cz75_whirlwind"] = { name = "Circaetus", desc = "ヘビを捕らえた猛禽が描かれている CZ75。\n\nスネークイーター（キャッチーなテーマソングは期待しないように）" },
	["cu_mp9_food_chain"] = { name = "Food Chain", desc = "モンスターの食物連鎖を鮮やかな色で描いた MP9。\n\n食うか食われるか" },
	["cu_galil_chroma_pink"] = { name = "Chromatic Aberration", desc = "位置をずらして塗装を施すことで立体視を可能にしたカスタムペイント。\n\n目にやさしいとは言い難い..." },
	["gs_glock_polymer"] = { name = "Clear Polymer", desc = "スライドを黄褐色、トリガーをブルーにペイントし、フレームには透明なポリマー材を採用。\n\nご覧のアイテムをそのままお届けします" },
	["gs_usps_hangedman"] = { name = "The Traitor", desc = "吊るされた男のタロットカードにインスピレーションを得てカスタムペイントされている。\n\n過去の失敗は将来の成功の青写真" },
	["cu_m4a4_love"] = { name = "In Living Color", desc = "ネオンカラーの手描きイラストが所狭しと並べられている。\n\n一人のための戦いは、皆のための戦い" },
	["gs_m249_combine"] = { name = "O.S.I.P.R.", desc = "ガンメタルグレーでカスタムペイントされ、仕上げに Combine のロゴを入れた M249。\n\nOverwatch 標準仕様パルスライフル" },
	["cu_negev_devtexture"] = { name = "dev_texture", desc = "オレンジ色の下地にグレーのテクスチャを加えたカスタムペイント。\n\nhammer.exe タイム" },
	["gs_p250_cybershell"] = { name = "Cyber Shell", desc = "シルバーのスライドとハニカムテクスチャのグリップが特徴のカスタムペイント。\n\n君はサイバーセキュリティの最前線にいる" },
	["cu_mac10_portable"] = { name = "Button Masher", desc = "透明なポリマー製ケーシングから十字キーと複数のボタンが飛び出ているように見えるカスタムペイント。\n\n「ゲハ戦争」は新たな局面に突入した" },
	["aq_xm1014_punk"] = { name = "XOXO", desc = "パンクをイメージした鮮やかなペイント。\n\nはいはい..." },
	["gs_r8_rustking"] = { name = "Junk Yard", desc = "青の下地にシルバーの落書きがいくつも重ねられ、シリンダーとフロントサイトは赤でペイントされている。\n\nキングにこそふさわしい" },
	["gs_sg553_deathmetal"] = { name = "Heavy Metal", desc = "黒の下地にオレンジと黄色のハイライトを入れて仕上げている。銃床には3つの星が描かれている。\n\n「スタッズのどれかがターボボタンなんだけど、どれだか思い出せねえ...」" },
	["am_ump45_electrowave"] = { name = "Oscillator", desc = "オレンジ、黒、グレーのランダムな柄が入れられている。\n\n誰にでも限界点はある... あんたの限界点はどこだ？" },
	["cu_deag_trigger_discipline"] = { name = "Trigger Discipline", desc = "バレルにピンクのアイソメトリックデザインが施されている。ハンマーとフロントサイトは水色にペイント。\n\n忍耐はそれ自体が報酬となる" },
	["sp_nova_wind_dispersal"] = { name = "Windblown", desc = "タンポポ畑と飛び散る胞子を描いたスプレーペイント。\n\nうちの芝生から出ていけ" },
	["am_nuclear_pattern4_famas"] = { name = "Meltdown", desc = "メタリック塗料で放射能警告のマークが描かれている。\n\nしばらくは近寄らないこと..." },
	["aa_spacerace_orange"] = { name = "Space Race", desc = "星と衛星を図案化した宇宙テーマのペイント。\n\n送受信" },
	["sp_spacerace_blue"] = { name = "Sputnik", desc = "星と衛星を図案化した宇宙テーマのペイント。\n\n送受信" },
	["sp_technowar_red"] = { name = "Fizzy POP", desc = "赤と黄褐色のレトロテクノな柄。\n\n戦は情報で制する" },
	["hy_technowar_rwb"] = { name = "POP AWP", desc = "白、赤、青のレトロテクノな柄。\n\n戦は情報で制する" },
	["hy_trainarchitect_green"] = { name = "Spring Twilly", desc = "多種多様なデザインを黒と緑の水圧転写で表現。\n\n最終案内です、まもなく列車が出発します" },
	["hy_trainarchitect"] = { name = "Autumn Twilly", desc = "多種多様なデザインを赤と黄褐色の水圧転写で表現。\n\n最終案内です、まもなく列車が出発します" },
	["gs_m4a4_coalition"] = { name = "The Coalition", desc = "多数の三角形が連なったデザインをゴールドと黒でカスタムペイントし、青のハイライトを加えている。\n\n一時的な同盟ではあるが、君のおかげで考え直す気になったよ..." },
	["cu_mac10_propaganda"] = { name = "Propaganda", desc = "「統制」「恐怖」といったロシア語と力強い視線が特徴のカスタムペイント。\n\n連中のことなんて信じていないんだろう？" },
	["gs_train_cz75"] = { name = "Syndicate", desc = "多数の三角形が連なったデザインをゴールドと黒でカスタムペイントし、青のハイライトを加えている。\n\n共に歩もう" },
	["hy_ak47lam_green"] = { name = "Green Laminate", desc = "AK のストック、グリップ、ハンドガードに緑色のラミネート加工が施されている。\n\nちょっとしたことが大事なんだ" },
	["sp_galil_caution"] = { name = "CAUTION!", desc = "黄色と黒のハイコントラストなシェブロン模様がスプレーペイントされている。\n\n不快も慣れれば快適になる" },
	["hy_geometric_steps_pearl"] = { name = "Prism Terrace", desc = "パール光沢の錯視柄ペイント。\n\nどこで始まりどこで終わるのか... そもそも終わりはあるのか？" },
	["gs_m4a1_vertigo"] = { name = "Imminent Danger", desc = "色とりどりの安全喚起デザインが入ったカスタムペイント。\n\n確かに警告はしたからな... ―武器商人 ブース" },
	["hy_vertigogeo"] = { name = "Schematic", desc = "マルチカラーの等角投影グリッドデザイン。\n\nお前は痛みを、私は勝利を覚えている" },
	["hy_vertigospray_blue"] = { name = "Strats", desc = "51階のフロア設計、空調システム、配線プランが水圧転写されている。\n\nこのプランでは..." },
	["hy_vertigoillusion"] = { name = "Framework", desc = "グレーと黄褐色の錯視柄が水圧転写されている。\n\nよく見えた？" },
	["hy_vertigoillusion_yellow"] = { name = "Interlock", desc = "黄色と青の錯視柄が水圧転写されている。\n\nよく見えた？" },
	["hy_vertigospray"] = { name = "Infrastructure", desc = "51階のフロア設計、空調システム、配線プランが水圧転写されている。\n\nこのプランでは..." },
	["aa_vertigogeo_neon"] = { name = "Digital Architect", desc = "マルチカラーの等角投影グリッドデザイン。\n\nお前は痛みを、私は勝利を覚えている" },
	["cu_sg553_caution"] = { name = "Hazard Pay", desc = "黄色のベースカラーの上にパイロンのオレンジ縞をアクセントとして入れたカスタムペイント。\n\n1発1発、思い切っていけ" },
	["aa_wiring"] = { name = "Breaker Box", desc = "アルマイト加工で配線されたワイヤー類が描かれている。\n\nご自身で修理を試みる前に、電気技師にご相談ください" },
	["aa_wiring_yellow"] = { name = "Faulty Wiring", desc = "配線されたワイヤー類が描かれている。\n\nご自身で修理を試みる前に、電気技師にご相談ください" },
	["sp_engine_dirty"] = { name = "Oil Change", desc = "エンジンパーツが描かれたスプレーペイント。\n\n「状態は悪そうだ...」" },
	["aa_engine_performance"] = { name = "Mechanism", desc = "アルマイト加工でエンジンパーツが描かれている。\n\n「状態は悪そうだ...」" },
	["cu_vertigo_fiveseven"] = { name = "Fall Hazard", desc = "様々な色で「落下」「注意」の文字が書かれたカスタムペイント。\n\n足もとに注意" },
	["sp_tire_tread_red"] = { name = "Red Tire", desc = "黒と赤のスプレーペイントでタイヤ痕が描かれている。\n\nタイヤを焦がせ" },
	["sp_tire_tread_blue"] = { name = "Blue Tire", desc = "黒と青のスプレーペイントでタイヤ痕が描かれている。\n\nタイヤを焦がせ" },
	["gs_ak47_abstract"] = { name = "Leet Museo", desc = "Dust II で Aロングに忍び寄るエリートクルーのテロリストをキュビズム風に描写したカスタムペイント。\n\n「想像できるものはすべて現実だ」" },
	["gs_aug_plague"] = { name = "Plague", desc = "ダークファンタジーとホラーに触発されたカスタムペイント。\n\n「飛んで火に入る...」" },
	["gs_mag7_bismuth"] = { name = "BI83 Spectrum", desc = "虹色に光るビスマス結晶を模したカスタムペイント。\n\n希少なものほど美しいのは何故だろう？" },
	["cu_deagle_kitch"] = { name = "Ocean Drive", desc = "高彩度のカラーリングで様々な形を描いたカスタムペイント。\n\n色も狙いも外せない" },
	["gs_dual_berettas_tread"] = { name = "Tread", desc = "両方の Beretta に波模様を手彫りしている。スライド部分はゴールドに塗装。\n\n細かなディテールは一番手間がかかり、寄与するところが一番大きく、それでいて一番見過ごされやすい" },
	["cu_famas_spectron"] = { name = "ZX Spectron", desc = "一昔前のゲーミングパソコンを意識したカスタムペイント。黒の下地にマルチカラーのアクセントを入れて仕上げている。\n\nクライヴは誇りに思うはずだ" },
	["gs_five_seven_efusion"] = { name = "Boost Protocol", desc = "ハイコントラストな色遣いのカスタムペイント。リアサイトの下にあるロボットのアイコンとスライドのアートワークが対になっている。\n\nコールサイン: MECHA 0272" },
	["aa_mp9_fuji_pink"] = { name = "Mount Fuji", desc = "アクリル塗料で富士山が描かれている。富士山の絵はパターンとして使われているため、武器によって見え方が異なる可能性がある。\n\n真っ赤な日が昇る" },
	["cu_g3sg1_tacticalmap"] = { name = "Keeping Tabs", desc = "Danger Zone のマップ表示をヒントにしたカスタムペイント。\n\n必要な情報は既にそろっている。―フェニックス参謀 フランツ・クリーゲルド" },
	["cu_mp7_khaki"] = { name = "Guerrilla", desc = "緑色の下地に黒でディテールが加えられたカスタムペイント。前を見据えるサルが描かれている。\n\nライオンがジャングルの王だったことなど一度もない" },
	["gs_m4_flowers"] = { name = "Spider Lily", desc = "下地はダークブルーで、弾倉とトリガーの上に赤い彼岸花が描かれている。\n\n明るい色は誘いではなく、警告だ" },
	["cu_mac10_toybox"] = { name = "Toybox", desc = "ニワトリ、エイリアン、爆弾解除ツールなどが明るい色で描かれたカスタムペイント。\n\nちゃんと後片付けしなさい" },
	["gs_bizon_flasher"] = { name = "Lumen", desc = "黒ベースに赤のアクセントが入ったカスタムペイント。弾倉は懐中電灯に見立ててある。\n\n行き先を照らせ" },
	["cu_glock_snackattack"] = { name = "Snack Attack", desc = "ジャンクフードのアクセサリーが樹脂の中に固められているように見えるカスタムペイント。\n\nスナックの逆襲" },
	["cu_ssg_overtake"] = { name = "Turbo Peek", desc = "スポーツカーが速さを競う、ネオンカラーのスナイパーライフル。\n\nドリフトは当然の権利だ" },
	["cu_usp_black_lotus"] = { name = "Black Lotus", desc = "スライド部分に「ブラックロータス」がカスタムペイントされている。\n\nピストルラウンドで3キルを加え、その後これを生贄に捧げる" },
	["gs_xm1014_watchdog"] = { name = "Watchdog", desc = "ジェイドグリーンの下地に背中合わせとなった2頭の獅子が描かれている。リアサイトの下には3頭目の獅子がいる。\n\n守護と繁栄を" },
	["cu_ak47_nightwish"] = { name = "Nightwish", desc = "ネオンカラーの鹿とドリームキャッチャーの絵にパール光沢仕上げを施したカスタムペイント。\n\nこれは特別な日のためにとっておいたんだ... ―武器商人 ブース" },
	["cu_bizon_spacecat"] = { name = "Space Cat", desc = "黒と紫の下地に猫のスペースアートが描かれたカスタムペイント。\n\n創造の肉球" },
	["cu_elites_beware"] = { name = "Melondrama", desc = "紺色の背景に禍々しいスイカが描かれた Beretta 用のカスタムペイント。\n\nイイ夢ミロヨ..." },
	["gs_famas_rapid_eyes"] = { name = "Rapid Eye Movement", desc = "ピンク系統のマスが連結されており、その中にリアルな目が描かれている。\n\n夢見人の目はせわしなく動く" },
	["cu_fiveseven_alpha_omega"] = { name = "Scrawl", desc = "黄色と青緑のベースカラーの上に大胆な筆致でカスタムデザインが手描きされている。\n\n最初にして最後の" },
	["cu_g3sg1_glade"] = { name = "Dream Glade", desc = "鬱蒼とした森の中心に、ぽっかりと青空がのぞいている。\n\n「あっ、森の中に空き地がある！」" },
	["gs_m4a1s_insomnia"] = { name = "Night Terror", desc = "不眠症患者の思考が書きなぐられたカスタムペイントの A1-S。\n\nやさしい夜の奥深く、光を求めて私はもがく" },
	["cu_mac10_pixie"] = { name = "Ensnared", desc = "武器の内部に囚われ、逃げ出そうとする妖精を描いたカスタムペイント。\n\n騙せない相手はまだ見つからない" },
	["cu_mag7_predictor"] = { name = "Foresight", desc = "勝敗予想を求められ、「勝利」と書かれた札に足を伸ばすタコを描いたカスタムペイント。\n\nいい予感がしてきた..." },
	["cu_mp7_fear"] = { name = "Abyssal Apparition", desc = "悪夢に沈みつつある孤独な魂を描いたカスタムペイント。\n\n運命からは逃れられない" },
	["gs_mp9_starlight"] = { name = "Starlight Protector", desc = "白の下地にレインボーカラーのたてがみを持つユニコーンが描かれたカスタムペイント。仕上げにゴールドのアクセントを入れている。\n\n神獣に選ばれたならば、その加護がありますように" },
