	["gs_arctic_mp9"] = { name = "Arctic Tri-Tone", desc = "白と青のカラーブロッキングでカスタムペイントし、同系色の迷彩で仕上げ。\n\n氷のような終幕" },
	["gsch_sport_ump45"] = { name = "Crimson Foil", desc = "赤とシルバーでカラーブロッキングされた印象的なデザインをカスタムペイント。\n\n厄介な問題は1本の弾倉で解決" },
	["aq_titanium_rainbow"] = { name = "Rainbow Spoon", desc = "レインボースプーン効果は、ペイントした武器を非常に高い温度に熱することで表れる。この手法からはほぼ無限のパターンが生み出される。\n\n無限の可能性" },
