	["sp_spray_waves_bravo"] = { name = "sp_spray_waves_bravo", desc = "対比色の短くて太いフリーハンドの線でスプレーペイントされた Seaside 記念モデル。\n\n反乱軍のお出かけにぴったり" },
	["hy_ocean_bravo"] = { name = "hy_ocean_bravo", desc = "青迷彩の柄が水圧転写された Seaside 記念モデル。\n\n我々の世界は陰謀に満ちている… だが、時に迷彩柄は見つけられるためにあるのだ。ー武器商人 ブース" },
	["sp_spitfire_famas_bravo"] = { name = "sp_spitfire_famas_bravo", desc = "サメの口が航空機のノーズアートのようにペイントされたCache 記念モデル。\n\nジェスターの撃墜確認" },
	["hy_tile_bravo"] = { name = "hy_tile_bravo", desc = "モザイク柄が水圧転写された Ali 記念モデル。\n\n忍耐は美徳である" },
	["an_navy_bravo"] = { name = "an_navy_bravo", desc = "クロムの下地でペイントされ、透過性のある濃紺色のアルマイト加工が施されたAli 記念モデル。\n\nヴァレリアの嘘で、既に一人失った… もう誰も失うつもりはない。ー指揮官 フェリックス・ライリー" },
	["sp_hazard_bravo"] = { name = "sp_hazard_bravo", desc = "ハザードストライプ模様にスプレーペイントされたSiege 記念モデル。\n\n横断禁止" },
	["sp_tape_dots_bravo"] = { name = "sp_tape_dots_bravo", desc = "ステンシルとして破ったテープの切れ端と穴の開いた金属を用いてスプレーペイントされたGwalior 記念モデル。\n\n心配するな… これから忙しくなる。ー武器商人 ブース" },
	["sp_palm_bravo"] = { name = "sp_palm_bravo", desc = "ステンシルに段ボールの切り抜きと目の細かいメッシュ、そしてヤシの葉を用いてスプレーペイントされた Gwalior 記念モデル。\n\n今日は美しくとも… 明日は灰と化す" },
	["hy_ddpat_bravo"] = { name = "hy_ddpat_bravo", desc = "デジタルディストラクティブパターン (DDPAT) の水圧転写がされた Ruins 記念モデル。\n\nたとえ見えなくても、はっきりと聞こえるだろう" },
	["so_jungle_bravo"] = { name = "so_jungle_bravo", desc = "パーツごとにジャングル色でスプレーペイントされた Ruins 記念モデル。\n\n破壊への欲求がある者に" },
	["so_tornado_bravo"] = { name = "so_tornado_bravo", desc = "パーツごとに竜巻のような色でスプレーペイントされた Ali 記念モデル。\n\n言葉は風のようなものだ。だが、風が命を奪うこともある" },
	["so_sand_bravo"] = { name = "so_sand_bravo", desc = "パーツごとに砂丘の色でスプレーペイントされた Gwalior 記念モデル。\n\nはみ出し者のジャーナリスト、アレックス・キンケイドは、Operation Vanguard の取材のためマグレブへ向かった後に消息を絶った" },
	["so_olive_bravo"] = { name = "so_olive_bravo", desc = "パーツごとにオリーブドラブ一色でスプレーペイントされた Cache 記念モデル。\n\n勝利が当然だと思ってはいけない" },
	["an_gunmetal_bravo"] = { name = "an_gunmetal_bravo", desc = "クロムの下地にガンメタルのアルマイト加工が施された Siege 記念モデル。\n\nお前はフェリックス・ライリーという人間を理解していない… あの男は決して屈しないんだ。―「裏切り者と真実の探求者」その1" },
	["am_ossify_blue_p2000_bravo"] = { name = "am_ossify_blue_p2000_bravo", desc = "金属の下地に透過性のある青色の抽象的な水圧転写がされた Seaside 記念モデル。\n\n波が砕けても、我々の決意は揺るがない。―侵入スペシャリスト コタロウ・イザキ" },
	["am_crumple_bravo"] = { name = "am_crumple_bravo", desc = "クロムの下地に異なる反射率のメタリック塗料で多角形模様がペイントされた Agency 記念モデル。\n\n鉛筆を置いて、手を上げて" },
	["aq_steel"] = { name = "aq_steel", desc = "外面は錆びているが、何の問題もなく使用できる。\n\n世の中には、自身の汚い行為を隠す必要のない者がいる" },
	["hy_hex"] = { name = "hy_hex", desc = "六角形模様が水圧転写されている。" },
	["hy_camo_large"] = { name = "hy_camo_large", desc = "特大の迷彩柄が水圧転写されている。" },
	["am_ddpatdense"] = { name = "am_ddpatdense", desc = "デジタルディストラクティブパターンが刻印された金属箔で覆われている。" },
	["twigs"] = { name = "twigs", desc = "ステンシルに小枝を用いてフリーハンドでスプレーペイント。" },
	["varicamo"] = { name = "varicamo", desc = "特殊な迷彩柄が水圧転写されている。\n\n破壊なくして再建なし" },
	["aq_damascus_knife"] = { name = "aq_damascus_knife", desc = "二種類の炭素鋼でできた鋼片から鍛造されている。\n\nついに、あなたの決意に相応しい強力な武器が登場" },
	["am_crystallized"] = { name = "am_crystallized", desc = "メタリック塗料でペイントされ、結晶のマスクを用いて模様が作成されている。\n\n誰もが何かしらの影響を及ぼしたいと思っている" },
	["snakeskin"] = { name = "snakeskin", desc = "ヘビの皮の模様が水圧転写されている。\n\nあなたがヴァレリアの思想を信じていないのは知っている… もし私がそれを暴けば、ヴァレリアはあなたの命を狙うだろう。ー「盾と蛇」その1" },
	["cu_usp-s_elegant"] = { name = "cu_usp-s_elegant", desc = "コバルトブルーを基調とし、スライド部分にCTのロゴが描かれたペイント。\n\n規則を守れば7人は救えるけど、あたしのやり方なら10人全員救える。どっちがいい？ ―救出スペシャリスト カルメン・コシネロ" },
	["hy_plaid2"] = { name = "hy_plaid2", desc = "トープとブルーグリーンの格子柄を水圧転写したもの。\n\nバグパイプではないが、葬儀の前には必ず曲を奏でる" },
	["cu_fiveseven_urban_hazard"] = { name = "cu_fiveseven_urban_hazard", desc = "アーバン迷彩に赤でアクセントをつけたカスタムペイント。\n\nブースは毎年、世界でもトップクラスのガンスミスを招いて最新作の展示会を開く" },
	["an_emerald"] = { name = "an_emerald", desc = "クロムの下地に透過性のあるエメラルド色のアルマイト加工を施している。\n\n偉大なるセバスチャン・エンケがここまで落ちぶれたのか？ まるで口うるさい女教師だ。何があったんだ...？ ―「教師と反逆児」その2" },
	["so_keycolors"] = { name = "so_keycolors", desc = "パーツごとにブルーとオレンジの配色でスプレーペイントされている。\n\n逆境もなんのその" },
	["cu_awp_mastery"] = { name = "cu_awp_mastery", desc = "水圧転写と繊細なステンシルを組み合わせ、ディテール表現に熱転写デカールを用いたたカスタムペイント。\n\nチェイス・ターナーは偉大だった... 後任は荷が重いぞ。―「不死鳥と新入り」その1" },
	["aq_dualberettas_cartel"] = { name = "aq_dualberettas_cartel", desc = "ガイコツと花と蛇が彫刻されている。\n\nだからハクスリーが頑張っているんだ。あとは彼女の背中を軽く押しさえすれば... ―「蛇と真実の探求者」その2" },
	["aq_famas_contour"] = { name = "aq_famas_contour", desc = "銃のフォルムを際立たせる赤とグレーのモダンなカスタムペイント。\n\nどんなときも、団結は力だ" },
	["cu_nova_hyperbeast"] = { name = "cu_nova_hyperbeast", desc = "サイケデリックな色調で魔獣を描いたカスタムペイント。\n\n鬼と呼ばれているそうだな。哀愁漂う男には不似合いな恐ろしい名だ。―傭兵 エリオット・キングスマン" },
	["hy_ocean_knife"] = { name = "hy_ocean_knife", desc = "ブルー迷彩が水圧転写されている。" },
	["cu_m4a1s_printstream"] = { name = "cu_m4a1s_printstream", desc = "コントラストのはっきりした黒と白のカスタムペイントにパール光沢のハイライトを入れて仕上げている。\n\nWHITE_1; BLACK_1; PEARLESCENT_1; SILENCED_1;" },
	["cu_usp_printstream"] = { name = "cu_usp_printstream", desc = "コントラストのはっきりした黒と白のカスタムペイントにパール光沢のハイライトを入れて仕上げている。\n\nWHITE_1; BLACK_1; PEARLESCENT_1; SILENCED_1; PISTOL_1;" },
	["m4a1s_black_lotus"] = { name = "m4a1s_black_lotus", desc = "青紫の下地に「ブラックロータス」がカスタムペイントされている。\n\nライフルラウンドで2キルを加え、その後これを生贄に捧げる" },
	["ssg08_dezastre"] = { name = "ssg08_dezastre", desc = "黒と白と赤で構成されたハイテクデザインのカスタムペイント。\n\nメーカーのガイドラインを守って安全に使用すること" },
	["ump45_neo_noir"] = { name = "ump45_neo_noir", desc = "グレースケールの背景の上にスタイリッシュなブルーマゼンタの女性をカスタムペイント。\n\n「ナイフを手に、立ち上がる時が来たのだと彼女は決意した」" },
